ЃерЃћрЃЏрЃЮрЃўрЃбрЃљрЃю, рЃБрЃюрЃЊрЃљ рЃЕрЃљрЃАрЃЋрЃљ head рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў. рЃАрЃ«рЃЋрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ',167,10,111),(23,'рЃЎрЃљрЃў рЃ«рЃљрЃа! рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў',167,19,111),(24,'рЃљрЃўрЃбрЃЋрЃўрЃарЃЌрЃљ рЃЎрЃў',167,19,111),(25,'рЃџрЃБрЃЎрЃљ, рЃерЃћрЃюрЃў рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃљрЃа рЃљрЃарЃўрЃА рЃЊрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃБрЃџрЃў, рЃљрЃЎрЃџрЃўрЃљ рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃфрЃ«рЃарЃўрЃџрЃўрЃА рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў.',167,10,112),(26,'рЃЊрЃљрЃЋрЃўрЃЌ,\n\nрЃЏрЃЌрЃљрЃЋрЃљрЃа рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ\n1.  img рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃљрЃџрЃб рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА,\n2. рЃљрЃАрЃћрЃЋрЃћ lang=\"ka\" рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА html рЃўрЃА рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃљрЃЊ\n\n рЃАрЃ«рЃЋрЃљ рЃњрЃЋрЃћрЃарЃЊрЃћрЃЉрЃќрЃћ: \n1. рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃЊрЃљрЃ«рЃБрЃарЃБрЃџрЃў html рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў\n2. <ul> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃА рЃерЃўрЃњрЃюрЃўрЃЌ рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃџрЃљрЃЊ рЃБрЃюрЃЊрЃљ рЃЏрЃЮрЃљрЃДрЃЮрЃџрЃЮ <li> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў, рЃАрЃ«рЃЋрЃљ рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃА рЃърЃўрЃарЃЊрЃљрЃърЃўрЃа рЃЏрЃўрЃЌрЃўрЃЌрЃћрЃЉрЃљ рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃўрЃљ.\nрЃАрЃгрЃЮрЃарЃў рЃўрЃЦрЃюрЃћрЃЉрЃЮрЃЊрЃљ: <ul> <li> <a> рЃўрЃћрЃарЃљрЃарЃЦрЃўрЃљ.\n3. Pages/Courses/REACTFRONDEND/REACTFRONTEND.html рЃљрЃЏ рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ <p> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃЊрЃљрЃ«рЃБрЃарЃБрЃџрЃў;\n\n\n',167,8,114),(27,'рЃарЃљ рЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃЉрЃўрЃф рЃЏрЃЦрЃЮрЃюрЃЊрЃљ рЃЏрЃўрЃЋрЃ«рЃЋрЃЊрЃў рЃарЃЮрЃњрЃЮрЃарЃф рЃ«рЃЊрЃћрЃЉрЃљ :рЃЊ рЃЌрЃЦрЃЋрЃћрЃюрЃА рЃАрЃћрЃарЃЋрЃћрЃарЃќрЃћрЃљ рЃЉрЃћрЃЦрЃерЃў рЃўрЃАрЃћ рЃњрЃљрЃЎрЃћрЃЌрЃћрЃЉрЃБрЃџрЃў рЃарЃЮрЃЏ first, operation рЃЊрЃљ secont рЃюрЃћрЃўрЃЏрЃћрЃЉрЃўрЃЌ рЃ«рЃЋрЃЊрЃћрЃЉрЃљ рЃарЃљрЃф рЃБрЃюрЃЊрЃљ рЃњрЃљрЃљрЃЎрЃћрЃЌрЃЮрЃА рЃЌрЃљрЃЋрЃўрЃАрЃўрЃЌ. рЃ«рЃЮрЃЮ?',148,19,148),(28,'рЃЎрЃљрЃарЃњрЃўрЃљ рЃЊрЃљрЃЋрЃўрЃЌ, html-рЃерЃў рЃњрЃљрЃгрЃћрЃарЃћ lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў',167,10,114),(29,'рЃЎрЃљрЃарЃњрЃўрЃљ!',167,19,114),(30,'рЃџрЃБрЃЎрЃљ:\n1. <html la=\"ka\"> рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃљрЃЊ рЃњрЃљрЃЦрЃЋрЃА.\n2. рЃАрЃљрЃЌрЃљрЃБрЃарЃў рЃЊрЃљрЃўрЃгрЃћ рЃДрЃЮрЃЋрЃћрЃџрЃЌрЃЋрЃўрЃА h1 рЃўрЃЌ рЃЊрЃљ рЃљрЃарЃљ h2 рЃўрЃЌ\n3. <meta charset=\"UTF-8\"> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў рЃБрЃюрЃЊрЃљ рЃўрЃДрЃЮрЃА рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃџрЃљрЃЊ <head> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃЊрЃљ рЃљрЃарЃљ body-рЃерЃў\nhttps://students.novatori.ge/рЃџрЃБрЃЎрЃљ_рЃЏрЃћрЃарЃљрЃЉрЃўрЃерЃЋрЃўрЃџрЃў/9/pages/courses/courses.html\n4. рЃюрЃљрЃЋрЃўрЃњрЃљрЃфрЃўрЃљ рЃњрЃЋрЃћрЃарЃЊрЃћрЃЉрЃА рЃерЃЮрЃарЃўрЃА рЃБрЃюрЃЊрЃљ рЃњрЃљрЃњрЃћрЃЎрЃћрЃЌрЃћрЃЉрЃўрЃюрЃљ <ul> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃБрЃџрЃў <li> рЃЊрЃљ рЃерЃўрЃњрЃюрЃўрЃЌ > <a> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃћрЃЉрЃўрЃЌ\n5. рЃЎрЃБрЃарЃАрЃўрЃА рЃЦрЃЋрЃћ-рЃњрЃЋрЃћрЃарЃЊрЃћрЃЉрЃў рЃБрЃюрЃЊрЃљ рЃўрЃДрЃЋрЃюрЃћрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃЌрЃљрЃю рЃЊрЃљ рЃ░рЃЦрЃЮрЃюрЃЊрЃћрЃЌ рЃАрЃљрЃЌрЃљрЃБрЃарЃћрЃЉрЃў\n\nрЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃАрЃгрЃЮрЃарЃўрЃљ ',167,9,118),(31,'рЃ░рЃЮ рЃЊрЃљ рЃЏрЃЌрЃљрЃЋрЃљрЃа рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ рЃцрЃљрЃўрЃџрЃў рЃљрЃа рЃљрЃарЃўрЃА рЃЏрЃўрЃЏрЃљрЃњрЃарЃћрЃЉрЃБрЃџрЃў',167,9,118),(32,'рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃњрЃљрЃарЃЊрЃљ рЃЮрЃарЃў рЃарЃљрЃЏрЃўрЃАрЃљ:\n1. <Th rowspan=\"6\">L <br> U <br> N <br> C <br> H\n</Th> <<< рЃњрЃљрЃЦрЃЋрЃА рЃЊрЃўрЃЊрЃў рЃљрЃАрЃЮрЃЌрЃў рЃњрЃљрЃ«рЃАрЃюрЃўрЃџрЃў\n2. html-рЃА lang рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃљрЃЊ рЃљрЃЦрЃЋрЃА рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃБрЃџрЃў',167,10,118),(33,'рЃАрЃгрЃЮрЃарЃўрЃљ рЃњрЃљрЃарЃЊрЃљ html рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃўрЃАрЃљ. рЃЎрЃљрЃў рЃ«рЃљрЃа',167,19,118),(34,'рЃћрЃџрЃћрЃюрЃћ, html рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃ«рЃљрЃќрЃерЃў рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃљрЃЊ рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃ«рЃАрЃюрЃўрЃџрЃў,\nрЃ»рЃћрЃа doctype,\nрЃЏрЃћрЃарЃћ html\nрЃЏрЃћрЃарЃћ head\nрЃЏрЃћрЃарЃћ  body\n\nрЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў, рЃДрЃЮрЃЕрЃљрЃд',167,19,119),(35,'рЃЋрЃљрЃ«рЃбрЃљрЃюрЃњ, doctype рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃБрЃџрЃў, \n<html> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃгрЃћрЃарЃўрЃџрЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў,\nрЃџрЃўрЃюрЃЎрЃћрЃЉрЃў рЃБрЃюрЃЊрЃљ рЃњрЃљрЃњрЃћрЃгрЃћрЃарЃљ ul рЃџрЃўрЃАрЃбрЃўрЃА рЃАрЃљрЃерЃБрЃљрЃџрЃћрЃЉрЃўрЃЌ,\nрЃцрЃљрЃўрЃџрЃћрЃЉрЃўрЃА рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃљрЃа рЃљрЃарЃўрЃА рЃЊрЃљрЃфрЃБрЃџрЃў, рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃЎрЃБрЃарЃАрЃћрЃЉрЃўрЃА рЃњрЃЋрЃћрЃарЃЊрЃў рЃЊрЃљ рЃљрЃарЃф рЃЦрЃЋрЃћ-рЃЎрЃБрЃарЃАрЃћрЃЉрЃўрЃА рЃњрЃЋрЃћрЃарЃЊрЃў.\n\n',167,8,121),(36,'рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў thead рЃЌрЃБ рЃњрЃљрЃ«рЃАрЃћрЃюрЃў, tbody-рЃўрЃф рЃЏрЃўрЃљрЃДрЃЮрЃџрЃћ рЃ«рЃЮрЃџрЃЏрЃћ',167,10,121),(37,'рЃЋрЃљрЃ«рЃбрЃљрЃюрЃњ, рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ рЃњрЃљрЃарЃЊрЃљ html рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃА рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃўрЃА рЃљрЃарЃЦрЃЮрЃюрЃўрЃАрЃљ',167,19,121),(38,'рЃЋрЃљрЃЕрЃћ, рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃљрЃЊ рЃњрЃљрЃЦрЃЋрЃА рЃцрЃљрЃўрЃџрЃў рЃљрЃбрЃЋрЃўрЃарЃЌрЃБрЃџрЃў. рЃЊрЃљрЃЉрЃЮрЃџрЃЮрЃћрЃЉрЃљ рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃЏрЃЮрЃбрЃЮрЃЋрЃћрЃЉрЃБрЃџрЃў рЃЊрЃљ рЃљрЃа рЃбрЃЋрЃўрЃарЃЌрЃљрЃЋрЃА рЃАрЃгрЃЮрЃарЃљрЃЊ. (.html рЃЏрЃўрЃБрЃгрЃћрЃарЃћ)',167,10,122),(39,'рЃњрЃўрЃЮрЃарЃњрЃў рЃЎрЃљрЃарЃњрЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў. html lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃўрЃА рЃњрЃљрЃгрЃћрЃарЃљ рЃљрЃа рЃЊрЃљрЃњрЃљрЃЋрЃўрЃгрЃДрЃЊрЃћрЃА рЃ«рЃЮрЃџрЃЏрЃћ рЃарЃљ. рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ',167,10,123),(40,'рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ. \nрЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў <html> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃгрЃћрЃарЃўрЃџрЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў',167,19,124),(41,'рЃџрЃћрЃЋрЃљрЃю :рЃЊрЃЊрЃЊ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ, рЃДрЃЮрЃЕрЃљрЃд. рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ рЃЏрЃБрЃАрЃўрЃЎрЃљрЃА рЃЋрЃћрЃа рЃЏрЃЮрЃЋрЃБрЃАрЃЏрЃўрЃюрЃћ рЃљрЃа рЃўрЃДрЃЮ рЃџрЃўрЃюрЃЎрЃў рЃАрЃгрЃЮрЃарЃљрЃЊ рЃњрЃљрЃгрЃћрЃарЃўрЃџрЃў, рЃљрЃю рЃцрЃљрЃўрЃџрЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃљрЃбрЃЋрЃўрЃарЃЌрЃБрЃџрЃў. рЃцрЃЮрЃарЃЏрЃљ рЃБрЃерЃћрЃфрЃЊрЃЮрЃЏрЃЮрЃљ',167,19,127),(42,'рЃЉрЃљрЃбрЃЮрЃюрЃЮ рЃЏрЃўрЃ«рЃћрЃўрЃџ рЃќрЃБрЃЎрЃўрЃЕрЃљ рЃљрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃА рЃЏрЃљрЃарЃљ рЃЏрЃљрЃўрЃюрЃф рЃЌрЃЦрЃЋрЃюрЃћрЃЏрЃљ рЃЦрЃБрЃўрЃќрЃЏрЃљ рЃЋрЃћрЃа рЃЊрЃљрЃЏрЃљрЃЏрЃљрЃарЃфрЃ«рЃљ рЃарЃљрЃЏрЃћ рЃљрЃ«рЃљрЃџрЃў рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃљ рЃњрЃљрЃЏрЃЮрЃБрЃерЃЋрЃўрЃЌ ',170,20,170),(43,'рЃЮрЃЏрЃЮ, рЃЎрЃљрЃарЃњрЃў рЃ«рЃљрЃа! рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў. placeholder--рЃўрЃф рЃарЃЮ рЃњрЃљрЃгрЃћрЃарЃћ рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ.\n рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў <html> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃгрЃћрЃарЃўрЃџрЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў',167,19,129),(44,'рЃљрЃа рЃљрЃарЃўрЃА рЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃљ рЃърЃљрЃърЃБрЃюрЃљ <3 рЃЏрЃЌрЃљрЃЋрЃљрЃарЃўрЃљ рЃњрЃљрЃљрЃЎрЃћрЃЌрЃћ. \n<html lang=\"En\"> рЃљрЃарЃљ, рЃърЃљрЃбрЃљрЃарЃљ рЃљрЃАрЃЮрЃЌрЃў рЃБрЃюрЃЊрЃљ en рЃўрЃА рЃњрЃљрЃгрЃћрЃарЃљ.\nрЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃЋрЃћрЃа рЃЋрЃўрЃърЃЮрЃЋрЃћ',167,10,132),(45,'рЃЮрЃЏрЃљрЃа, рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃўрЃА рЃцрЃљрЃўрЃџрЃў рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃљрЃЊ рЃљрЃарЃўрЃА рЃљрЃбрЃЋрЃўрЃарЃЌрЃБрЃџрЃў, рЃЊрЃљрЃЉрЃЮрЃџрЃЮрЃћрЃЉрЃљ рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃгрЃћрЃарЃўрЃџрЃў рЃцрЃљрЃўрЃџрЃќрЃћ. (.html рЃЏрЃўрЃљрЃгрЃћрЃарЃћ рЃЉрЃЮрЃџрЃЮрЃерЃў) ',167,19,133),(46,'рЃЌрЃћрЃюрЃњрЃўрЃќ, \n1. рЃюрЃљрЃЋрЃўрЃњрЃљрЃфрЃўрЃљ рЃБрЃюрЃЊрЃљ рЃњрЃљрЃњрЃћрЃгрЃћрЃарЃљ <ul> <li> <a> рЃърЃарЃўрЃюрЃфрЃўрЃърЃўрЃЌ, рЃљрЃюрЃБ рЃ»рЃћрЃа рЃњрЃљрЃњрЃћрЃ«рЃАрЃюрЃљ рЃБрЃюрЃЮрЃЏрЃарЃЮ рЃАрЃўрЃљ, рЃерЃћрЃЏрЃЊрЃћрЃњ рЃЏрЃўрЃАрЃў рЃџрЃў-рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў рЃЊрЃљ рЃљрЃЏ рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃњрЃљрЃњрЃћрЃгрЃћрЃарЃљ рЃџрЃўрЃюрЃЎрЃћрЃЉрЃў.\n2. рЃАрЃ«рЃЋрЃљ рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ рЃњрЃљрЃЦрЃЋрЃА, рЃАрЃгрЃЮрЃарЃљрЃЊ рЃЏрЃљрЃњрЃарЃљрЃЏ рЃўрЃЦ <html> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃгрЃћрЃарЃўрЃџрЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў\n3. рЃЎрЃБрЃарЃАрЃћрЃЉрЃўрЃА рЃњрЃЋрЃћрЃарЃЊрЃћрЃЉрЃў рЃљрЃа рЃљрЃарЃўрЃљрЃю рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃБрЃџрЃў.\n\nрЃАрЃ«рЃЋрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ, рЃДрЃЮрЃЕрЃљрЃд',167,19,134),(47,'рЃарЃћрЃЋрЃљрЃќ, рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў, рЃЎрЃљрЃў рЃ«рЃљрЃа',167,8,138),(48,'рЃљрЃЦрЃљрЃф рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ, рЃДрЃЮрЃЕрЃљрЃд',167,10,138),(49,'рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљ <3',111,19,111),(50,'рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў',167,19,138),(51,'рЃЉрЃћрЃЦрЃљ, рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў. рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў label-рЃА рЃарЃЮ рЃерЃћрЃЦрЃЏрЃюрЃў, рЃерЃўрЃњрЃюрЃўрЃЌ рЃарЃљрЃЏрЃћ рЃбрЃћрЃЦрЃАрЃбрЃў рЃЕрЃљрЃгрЃћрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃарЃЮ рЃЋрЃўрЃќрЃБрЃљрЃџрЃБрЃарЃљрЃЊрЃљрЃф рЃЕрЃљрЃюрЃЊрЃћрЃА.\n\nрЃарЃљрЃф рЃерЃћрЃћрЃ«рЃћрЃЉрЃљ рЃфрЃ«рЃарЃўрЃџрЃћрЃЉрЃА, рЃћрЃА рЃцрЃљрЃўрЃџрЃў рЃфрЃ«рЃарЃўрЃџрЃћрЃЉрЃўрЃА рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃќрЃћ рЃБрЃюрЃЊрЃљ рЃљрЃњрЃћрЃбрЃЋрЃўрЃарЃЌрЃљ. \nрЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃЋрЃюрЃљрЃ«рЃћ head рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃћрЃџрЃў рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃљ рЃЊрЃљ рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА, thead рЃЋрЃћрЃа рЃЕрЃљрЃљрЃюрЃљрЃфрЃЋрЃџрЃћрЃЉрЃА, рЃћрЃњ рЃЕрЃЋрЃћрЃБрЃџрЃћрЃЉрЃарЃўрЃЋрЃљрЃЊ body рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃБрЃюрЃЊрЃљ \nрЃЕрЃљрЃАрЃЋрЃљ. рЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃАрЃгрЃЮрЃарЃўрЃљ',167,19,140),(52,'рЃЎрЃљрЃарЃњрЃўрЃљ, рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃерЃћрЃюрЃўрЃерЃЋрЃюрЃљ рЃЏрЃљрЃЦрЃЋрЃА: 1. рЃАрЃћрЃџрЃћрЃЦрЃбрЃЏрЃљ рЃарЃљ рЃЊрЃљрЃњрЃўрЃерЃљрЃЋрЃљ, рЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃю 2-рЃА рЃЌрЃБ рЃЏрЃўрЃћрЃфрЃў рЃџрЃћрЃўрЃЉрЃџрЃў. 2. рЃљрЃерЃЎрЃљрЃарЃљрЃЊ рЃ«рЃћрЃџрЃўрЃЌ рЃљрЃа рЃЊрЃљрЃњрЃўрЃгрЃћрЃарЃўрЃљ HTML-рЃўрЃА рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ, VSCode-рЃА рЃЊрЃљрЃљрЃњрЃћрЃюрЃћрЃарЃўрЃарЃћрЃЉрЃўрЃюрЃћ рЃЊрЃљ рЃљрЃа рЃљрЃарЃўрЃА рЃћрЃњ рЃАрЃгрЃЮрЃарЃў :D рЃ«рЃћрЃџрЃўрЃЌ рЃерЃћрЃћрЃЕрЃЋрЃўрЃћ рЃгрЃћрЃарЃљрЃА, рЃ»рЃЮрЃЉрЃўрЃљ.',2,19,123),(53,'рЃЊрЃљрЃЕрЃў, рЃДрЃЮрЃЕрЃљрЃд рЃЏрЃљрЃарЃљ рЃарЃљ рЃерЃБрЃљрЃерЃўрЃљ рЃћрЃА? :))) рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃАрЃ«рЃЋрЃљ рЃарЃљрЃЏрЃћ рЃўрЃДрЃЮ. рЃЏрЃћрЃЮрЃарЃћ рЃЎрЃљрЃџрЃЎрЃБрЃџрЃљрЃбрЃЮрЃарЃўрЃА рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃў рЃЎрЃўрЃЊрЃћ рЃфрЃљрЃарЃўрЃћрЃџрЃўрЃљ, рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃЊрЃљрЃгрЃћрЃарЃЮ рЃ»рЃЮрЃЉрЃўрЃљ рЃАрЃ«рЃЋрЃљ рЃарЃљрЃЏрЃћрЃћрЃЉрЃўрЃА рЃЎрЃћрЃЌрЃћрЃЉрЃљрЃА :D',2,19,125),(54,'рЃюрЃўрЃюрЃў path-рЃћрЃЉрЃў рЃњрЃљрЃЦрЃЋрЃА рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃљрЃЊ рЃњрЃљрЃЎрЃћрЃЌрЃћрЃЉрЃБрЃџрЃў, website рЃцрЃЮрЃџрЃЊрЃћрЃарЃў рЃњрЃљрЃЦрЃЋрЃА рЃюрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃў, рЃарЃљрЃф рЃАрЃћрЃарЃЋрЃћрЃарЃќрЃћ рЃљрЃбрЃЋрЃўрЃарЃЌрЃЋрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ рЃарЃљ рЃЌрЃЦрЃЏрЃљ рЃБрЃюрЃЊрЃљ рЃљрЃдрЃљрЃа рЃљрЃарЃАрЃћрЃЉрЃЮрЃЉрЃА. рЃърЃџрЃБрЃА рЃЎрЃўрЃЊрЃћрЃЋ, рЃЋрЃћрЃЉрЃАрЃљрЃўрЃб рЃцрЃЮрЃџрЃЊрЃћрЃарЃљрЃЏрЃЊрЃћ ../ рЃўрЃюрЃАрЃбрЃарЃБрЃЦрЃфрЃўрЃљ рЃњрЃўрЃгрЃћрЃарЃўрЃљ, рЃћрЃА ../ рЃЊрЃљ website/ рЃцрЃљрЃЦрЃбрЃўрЃБрЃарЃљрЃЊ рЃљрЃюрЃћрЃўрЃбрЃарЃљрЃџрЃћрЃЉрЃћрЃю рЃћрЃарЃЌрЃБрЃарЃЌрЃА. рЃњрЃљрЃљрЃАрЃгрЃЮрЃарЃћ рЃЊрЃљ рЃЊрЃљрЃЏрЃўрЃЉрЃарЃБрЃюрЃћ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ.',2,8,143),(55,'рЃЎрЃљрЃарЃњрЃўрЃљ, рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ 1 рЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃљрЃА рЃЋрЃ«рЃћрЃЊрЃљрЃЋ <h1> Planets </h1> рЃљрЃў рЃљрЃЦ рЃАрЃцрЃћрЃўрЃАрЃћрЃЉрЃў, рЃљрЃюрЃБ рЃњрЃљрЃЏрЃЮрЃбрЃЮрЃЋрЃћрЃЉрЃћрЃЉрЃў рЃљрЃарЃљрЃцрЃћрЃа рЃерЃБрЃљрЃерЃўрЃљ, рЃљрЃАрЃћ рЃљрЃа рЃгрЃћрЃарЃћрЃю рЃ«рЃЮрЃџрЃЏрЃћ рЃарЃЮрЃњрЃЮрЃарЃф рЃгрЃћрЃАрЃў.',2,10,143),(56,'рЃЎрЃљрЃарЃњрЃўрЃљ, рЃЕрЃљрЃгрЃўрЃЎрЃгрЃўрЃЎрЃћрЃЉрЃБрЃџрЃўрЃљ рЃЎрЃЮрЃЊрЃў рЃњрЃћрЃюрЃфрЃЋрЃљрЃџрЃћ :))) рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ рЃерЃћрЃюрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃА рЃюрЃБ рЃЊрЃљрЃћрЃЏрЃАрЃњрЃљрЃЋрЃАрЃћрЃЉрЃў рЃЊрЃљ label-рЃћрЃЉрЃў рЃўрЃ«рЃЏрЃљрЃарЃћ :D',2,19,143),(57,'рЃЌрЃљрЃарЃљрЃе рЃЉрЃарЃљрЃЋрЃЮ, рЃЏрЃљрЃњрЃарЃљрЃЊ рЃЋрЃўрЃдрЃљрЃЊрЃљрЃЋрЃћ рЃфрЃљрЃарЃўрЃћрЃџ рЃџрЃћрЃўрЃЉрЃџрЃћрЃЉрЃќрЃћ, рЃЊрЃўрЃќрЃљрЃўрЃюрЃАрЃљрЃф рЃЊрЃљрЃљрЃЏрЃАрЃњрЃљрЃЋрЃАрЃћ рЃЊрЃљ рЃџрЃћрЃўрЃЉрЃџрЃўрЃф рЃљрЃа рЃЊрЃљрЃњрЃљрЃЋрЃўрЃгрЃДрЃЊрЃљ :)))) рЃЏрЃљрЃњрЃљрЃарЃў рЃЎрЃљрЃфрЃў рЃ«рЃљрЃа',2,19,144),(58,'рЃЎрЃљрЃарЃњрЃўрЃљ рЃџрЃБрЃЎрЃљ, рЃљрЃа рЃЏрЃљрЃЦрЃЋрЃА рЃерЃћрЃюрЃўрЃерЃЋрЃюрЃљ.',2,10,145),(59,'рЃюрЃЮрЃарЃЏрЃљрЃџрЃБрЃарЃўрЃљ, рЃАрЃћрЃџрЃћрЃЦрЃбрЃўрЃА id рЃАрЃ«рЃЋрЃљ рЃњрЃўрЃгрЃћрЃарЃўрЃљ рЃЊрЃљ label-рЃерЃў рЃЎрЃўрЃЊрЃћрЃЋ рЃарЃљрЃдрЃљрЃф рЃАрЃ«рЃЋрЃљрЃќрЃћ рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃЊрЃљрЃЉрЃЏрЃБрЃџрЃў рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ.',2,19,145),(60,'рЃљрЃюрЃљ, рЃњрЃљрЃЊрЃљрЃЊрЃў рЃерЃћрЃюрЃў рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃўрЃА рЃџрЃўрЃюрЃЎрЃќрЃћ, рЃюрЃљрЃ«рЃљрЃЋ рЃарЃЮрЃЏ рЃџрЃўрЃюрЃЎрЃћрЃЉрЃў рЃљрЃа рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА. рЃћрЃА рЃўрЃЏрЃўрЃА рЃЉрЃарЃљрЃџрЃўрЃљ рЃарЃЮрЃЏ pages рЃцрЃЮрЃџрЃЊрЃћрЃарЃА рЃЦрЃЋрЃўрЃљ Pages рЃЊрЃљ рЃерЃћрЃю рЃЎрЃў lower case-рЃўрЃЌ рЃњрЃўрЃгрЃћрЃарЃўрЃљ рЃљрЃюрЃЦрЃЮрЃа рЃџрЃўрЃюрЃЎрЃерЃў рЃЏрЃўрЃАрЃў рЃЏрЃўрЃАрЃљрЃЏрЃљрЃарЃЌрЃў. рЃЋрЃўрЃюрЃЊрЃЮрЃБрЃАрЃќрЃћ рЃљрЃЏрЃљрЃю рЃўрЃЏрЃБрЃерЃљрЃЋрЃљ, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃџрЃўрЃюрЃБрЃЦрЃАрЃќрЃћ рЃарЃЮрЃњрЃЮрЃарЃф рЃЎрЃў рЃљрЃўрЃбрЃЋрЃўрЃарЃЌрЃљ рЃерЃћрЃюрЃў рЃЋрЃћрЃЉрЃАрЃљрЃўрЃбрЃў, рЃћрЃњрЃарЃћрЃЋрЃћ рЃњрЃљрЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃЊрЃљ рЃарЃЮрЃњрЃЮрЃарЃф рЃ«рЃћрЃЊрЃљрЃЋ. рЃарЃљрЃЊрЃњрЃљрЃю рЃџрЃўрЃюрЃБрЃЦрЃАрЃў case sensitive рЃАрЃўрЃАрЃбрЃћрЃЏрЃљрЃљ.',2,9,148),(61,'рЃњрЃљрЃљрЃАрЃгрЃЮрЃарЃћ рЃЊрЃљ рЃЊрЃљрЃЏрЃўрЃЉрЃарЃБрЃюрЃћ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ.',2,9,148),(62,'рЃўрЃЎрЃЮрЃюрЃўрЃА рЃџрЃўрЃюрЃЎрЃў рЃљрЃа рЃњрЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃЉрЃА. рЃЊрЃљрЃџрЃерЃћ рЃЎрЃљрЃарЃњрЃў рЃ«рЃљрЃа, рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃў рЃЊрЃљ рЃюрЃљрЃарЃўрЃАрЃћрЃарЃЕрЃљрЃџрЃў рЃћрЃбрЃДрЃЮрЃЉрЃљ :))',2,10,148),(63,'рЃЎрЃўрЃЉрЃљрЃбрЃЮрЃюрЃЮ, рЃЏрЃљрЃАрЃћрЃљ :D рЃЎрЃљрЃарЃњрЃўрЃљ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ, рЃљрЃа рЃЏрЃљрЃЦрЃЋрЃА рЃерЃћрЃюрЃўрЃерЃЋрЃюрЃљ. рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ рЃџрЃћрЃЦрЃбрЃЮрЃарЃА рЃюрЃБ рЃЊрЃљрЃћрЃЏрЃАрЃњрЃљрЃЋрЃАрЃћрЃЉрЃў рЃЊрЃљ label-рЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћ рЃ«рЃЮрЃџрЃЏрЃћ :D',2,19,148),(64,'рЃЏрЃљрЃЌрЃћ рЃЎрЃљрЃарЃњрЃўрЃљ, рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ рЃњрЃљрЃЏрЃЮрЃбрЃЮрЃЋрЃћрЃЉрЃћрЃЉрЃў рЃљрЃа рЃљрЃарЃўрЃА рЃАрЃљрЃГрЃўрЃарЃЮ рЃарЃЮрЃЊрЃћрЃАрЃљрЃф рЃбрЃћрЃњрЃерЃў рЃгрЃћрЃа рЃбрЃћрЃЦрЃАрЃбрЃБрЃа рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљрЃА. <th> monday </th> рЃљрЃАрЃћ рЃљрЃарЃљ, рЃАрЃгрЃЮрЃарЃўрЃљ рЃљрЃАрЃћ: <th>monday</th>',2,10,135),(65,'рЃЎрЃљрЃарЃњрЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў. рЃърЃљрЃбрЃарЃўрЃЮрЃбрЃБрЃџрЃў рЃАрЃБрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА 5-рЃўрЃљрЃюрЃў + рЃўрЃЌ рЃЎрЃўрЃЊрЃћрЃЋ :D doctype рЃњрЃљрЃЎрЃџрЃўрЃљ рЃарЃљрЃАрЃљрЃф рЃЋрЃ«рЃћрЃЊрЃљрЃЋ рЃЊрЃљ html-рЃўрЃА рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃЊрЃљрЃњрЃћрЃюрЃћрЃарЃћрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЦрЃЋрЃА, рЃ«рЃћрЃџрЃўрЃЌ рЃљрЃа рЃЊрЃљрЃњрЃўрЃгрЃћрЃарЃўрЃљ. рЃњрЃЦрЃЮрЃюрЃўрЃљ рЃљрЃЦрЃљрЃЏрЃЊрЃћ рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃћрЃЉрЃљ?',2,3,149),(66,'рЃЎрЃљрЃарЃњрЃўрЃљ, рЃерЃћрЃюрЃўрЃерЃЋрЃюрЃљ рЃљрЃа рЃЏрЃљрЃЦрЃЋрЃА',2,10,149),(67,'required рЃљрЃарЃўрЃА boolean рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў, рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃљрЃЊ рЃљрЃа рЃАрЃљрЃГрЃўрЃарЃЮрЃћрЃЉрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃўрЃА рЃњрЃљрЃЊрЃљрЃфрЃћрЃЏрЃљрЃА, =\"\" рЃљрЃарЃўрЃА рЃќрЃћрЃЊрЃЏрЃћрЃбрЃў. рЃарЃљрЃбрЃў, html рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃА рЃюрЃБ рЃљрЃњрЃћрЃюрЃћрЃарЃўрЃарЃћрЃЉрЃўрЃюрЃћрЃЉ рЃћрЃЊрЃўрЃбрЃЮрЃарЃА, рЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃљрЃгрЃћрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃљрЃЏ рЃћрЃбрЃљрЃърЃќрЃћ рЃ»рЃЮрЃЉрЃўрЃљ. doctype рЃљрЃЎрЃџрЃўрЃљ.',2,19,149),(68,'рЃЏрЃљрЃарЃў, рЃАрЃбрЃўрЃџрЃў рЃЊрЃљрЃўрЃфрЃљрЃЋрЃў, рЃЌрЃБ рЃћрЃарЃЌрЃў th-рЃўрЃА рЃерЃўрЃњрЃЌрЃљрЃЋрЃАрЃА рЃфрЃљрЃџрЃЎрЃћ рЃ«рЃљрЃќрЃќрЃћ рЃгрЃћрЃа, рЃДрЃЋрЃћрЃџрЃљ рЃЏрЃљрЃАрЃћ рЃБрЃюрЃЊрЃљ рЃўрЃДрЃЮрЃА. рЃќрЃЮрЃњрЃў th рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў 1 рЃ«рЃљрЃќрЃќрЃћ рЃњрЃљрЃЦрЃЋрЃА рЃЊрЃљ рЃќрЃЮрЃњрЃўрЃф 3 рЃ«рЃљрЃќрЃќрЃћ.\n\nрЃљрЃАрЃћрЃЋрЃћ, рЃарЃЮрЃЊрЃћрЃАрЃљрЃф th-рЃА рЃўрЃДрЃћрЃюрЃћрЃЉ рЃ░рЃЮрЃарЃўрЃќрЃЮрЃюрЃбрЃљрЃџрЃБрЃарЃў рЃ«рЃљрЃќрЃўрЃА рЃЊрЃљрЃАрЃљрЃАрЃљрЃЌрЃљрЃБрЃарЃћрЃЉрЃџрЃљрЃЊ, рЃАрЃљрЃГрЃўрЃарЃЮрЃљ рЃЏрЃўрЃБрЃЌрЃўрЃЌрЃЮ scope=\"row\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў. рЃЋрЃЮрЃўрЃЊ рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃћрЃЉрЃерЃў рЃљрЃЦрЃћрЃЊрЃљрЃюрЃЋрЃћ рЃЏрЃўрЃћрЃЕрЃЋрЃўрЃћ / рЃўрЃА рЃгрЃћрЃарЃљрЃА, рЃљрЃћ рЃ»рЃЮрЃЉрЃўрЃљ, рЃарЃћрЃљрЃЦрЃбрЃќрЃћ рЃљрЃдрЃљрЃа рЃњрЃљрЃњрЃўрЃГрЃўрЃарЃЊрЃћрЃЉрЃљ рЃЏрЃћрЃарЃћ :)) рЃАрЃљрЃћрЃарЃЌрЃЮ рЃ»рЃљрЃЏрЃерЃў рЃЎрЃљрЃарЃњрЃўрЃљ рЃФрЃљрЃџрЃўрЃљрЃю.',2,10,154),(69,'рЃЎрЃљрЃарЃњрЃўрЃљ, select-рЃќрЃћ рЃњрЃљрЃЎрЃџрЃўрЃљ id рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў. рЃЊрЃљ рЃюрЃБ рЃљрЃњрЃћрЃюрЃћрЃарЃўрЃарЃћрЃЉ html рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃћрЃЉрЃА, рЃЏрЃўрЃћрЃЕрЃЋрЃўрЃћ рЃ«рЃћрЃџрЃўрЃЌ рЃгрЃћрЃарЃљрЃА :)))))',2,19,154),(70,'UI/UX рЃўрЃА рЃџрЃўрЃюрЃЎрЃў рЃљрЃа рЃњрЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃЉрЃА. рЃљрЃЏрЃўрЃА рЃЏрЃўрЃќрЃћрЃќрЃў рЃўрЃА рЃљрЃарЃўрЃА, рЃарЃЮрЃЏ рЃцрЃЮрЃЊрЃЊрЃћрЃарЃА рЃЊрЃўрЃЊрЃў рЃљрЃАрЃЮрЃћрЃЉрЃўрЃЌ рЃЦрЃЋрЃўрЃљ рЃАрЃљрЃ«рЃћрЃџрЃў, рЃерЃћрЃю рЃЎрЃў рЃџрЃўрЃюрЃЎрЃерЃў рЃърЃљрЃбрЃљрЃарЃљ рЃљрЃАрЃЮрЃћрЃЉрЃў рЃњрЃўрЃгрЃћрЃарЃўрЃљ. рЃЋрЃўрЃюрЃЊрЃЮрЃБрЃАрЃќрЃћ рЃћрЃњ рЃљрЃарЃљрЃБрЃерЃљрЃЋрЃА, рЃџрЃўрЃюрЃБрЃЦрЃАрЃќрЃћ рЃЎрЃўрЃЊрЃћрЃЋ рЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃљрЃљ. рЃАрЃљрЃћрЃарЃЌрЃЮ рЃ»рЃљрЃЏрЃерЃў рЃЎрЃљрЃарЃњрЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў.',2,19,155),(71,'рЃњрЃўрЃЮ, <center/> рЃљрЃАрЃћ рЃљрЃа рЃўрЃ«рЃБрЃарЃћрЃЉрЃљ рЃбрЃћрЃњрЃћрЃЉрЃў, рЃАрЃџрЃћрЃерЃў рЃБрЃюрЃЊрЃљ рЃбрЃћрЃњрЃўрЃА рЃЊрЃљрЃАрЃљрЃ«рЃћрЃџрЃћрЃЉрЃљрЃЏрЃЊрЃћ, рЃљрЃюрЃБ рЃљрЃАрЃћ </center>',2,10,160),(72,'<link rel=\"icon\" href=\"../../Desktop/WEBSITE 2/IMAGES/apple.svg\"/>\n\nрЃџрЃўрЃюрЃЎрЃерЃў рЃЊрЃћрЃАрЃЎрЃбрЃЮрЃърЃў рЃњрЃљрЃЦрЃЋрЃА рЃюрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃў, рЃАрЃћрЃарЃЋрЃћрЃарЃќрЃћ рЃарЃЮрЃЏ рЃљрЃЏрЃўрЃбрЃЋрЃўрЃарЃЌрЃћ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃЋрЃАрЃўрЃЮ, рЃерЃћрЃюрЃў рЃЊрЃћрЃАрЃЎрЃбрЃЮрЃърЃў рЃАрЃћрЃарЃЋрЃћрЃарЃќрЃћ рЃљрЃдрЃљрЃа рЃљрЃарЃўрЃА.',2,10,160),(73,'рЃЎрЃўрЃЊрЃћрЃЋ рЃћрЃарЃЌрЃ«рЃћрЃџ, рЃљрЃАрЃћ рЃљрЃа рЃўрЃ«рЃБрЃарЃћрЃЉрЃљ рЃбрЃћрЃњрЃћрЃЉрЃў <br/>',2,10,160),(74,'рЃарЃЮрЃЊрЃћрЃАрЃљрЃф рЃљрЃЏрЃ«рЃћрЃџрЃљ рЃерЃўрЃњрЃЌрЃљрЃЋрЃАрЃў рЃљрЃЦрЃЋрЃА рЃарЃљрЃўрЃЏрЃћ рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃА, рЃ»рЃЮрЃЉрЃўрЃљ рЃарЃЮрЃЏ рЃњрЃљрЃЏрЃЮрЃДрЃЮ рЃерЃўрЃњрЃЌрЃљрЃЋрЃАрЃў рЃбрЃћрЃњрЃћрЃЉрЃўрЃАрЃљрЃњрЃљрЃю рЃЊрЃљ рЃфрЃљрЃџрЃЎрЃћ рЃ«рЃљрЃќрЃќрЃћ рЃЕрЃљрЃЏрЃЮрЃўрЃбрЃљрЃюрЃЮ <td rowspan=\"6\" bgcolor=\"coral\"><center>L<br/>U<br/>N<br/>C<br/>H<br/></td></center>',2,10,160),(75,'рЃњрЃљрЃљрЃАрЃгрЃЮрЃарЃћ рЃЊрЃљ рЃЊрЃљрЃЏрЃўрЃЉрЃарЃБрЃюрЃћ рЃарЃљ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ',2,10,160),(77,'рЃЏрЃњрЃЮрЃюрЃў рЃљрЃарЃљрЃАрЃгрЃЮрЃа рЃљрЃЊр