АрЃљрЃГрЃўрЃарЃЮ.',2,8,163),(84,'рЃЏрЃћрЃЌрЃЮрЃарЃЏрЃћрЃбрЃћ рЃ«рЃљрЃќрЃќрЃћ рЃњрЃљрЃЦрЃЋрЃА рЃўрЃюрЃЊрЃћрЃюрЃбрЃљрЃфрЃўрЃљ рЃЊрЃљрЃарЃдрЃЋрЃћрЃБрЃџрЃў. рЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃЎрЃљрЃарЃњрЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў.',2,10,163),(85,'рЃЎрЃљрЃарЃњрЃўрЃљ рЃњрЃўрЃњрЃљ, label-рЃћрЃЉрЃў рЃўрЃ«рЃЏрЃљрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃљрЃа рЃЊрЃљрЃњрЃљрЃЋрЃўрЃгрЃДрЃЊрЃћрЃА. рЃЋрЃўрЃфрЃў, рЃЏрЃћрЃф рЃЊрЃљрЃЏрЃљрЃЋрЃўрЃгрЃДрЃЊрЃљ рЃЋрЃўрЃЊрЃћрЃЮрЃерЃў. ',2,19,163),(86,'рЃЎрЃљрЃарЃњрЃў рЃ«рЃљрЃа рЃЉрЃљрЃбрЃЮрЃюрЃЮ рЃЉрЃљрЃЋрЃерЃЋрЃЮ :)))',2,20,170),(87,'рЃњрЃўрЃЮ, meta рЃЊрЃљ title рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃћрЃЉрЃў head рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃА рЃерЃЋрЃўрЃџрЃћрЃЉрЃў рЃљрЃарЃўрЃљрЃю, рЃњрЃљрЃљрЃАрЃгрЃЮрЃарЃћ рЃЊрЃљ рЃЊрЃљрЃЏрЃўрЃЉрЃарЃБрЃюрЃћ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ.',2,19,166),(88,'label-рЃћрЃЉрЃў рЃўрЃ«рЃЏрЃљрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃцрЃЮрЃарЃЏрЃљрЃерЃў, рЃЏрЃћ рЃюрЃБ рЃЊрЃљрЃЏрЃћрЃЏрЃАрЃњрЃљрЃЋрЃАрЃћрЃЉрЃў :))))))',2,19,166),(89,'рЃЎрЃљрЃарЃњрЃўрЃљ, label-рЃћрЃЉрЃў рЃўрЃ«рЃЏрЃљрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ, рЃЏрЃћ рЃюрЃБ рЃЊрЃљрЃЏрЃћрЃЏрЃАрЃњрЃљрЃЋрЃАрЃћрЃЉрЃў :)))))',2,19,165),(90,'рЃЌрЃљрЃЌрЃўрЃљ, label for рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃерЃў рЃўрЃгрЃћрЃарЃћрЃЉрЃљ рЃўрЃюрЃцрЃБрЃЌрЃўрЃА id. рЃерЃћрЃюрЃА рЃўрЃюрЃцрЃБрЃЌрЃћрЃЉрЃА id-рЃћрЃЉрЃў рЃљрЃЎрЃџрЃўрЃљ. рЃњрЃљрЃљрЃАрЃгрЃЮрЃарЃћ рЃЊрЃљ рЃЊрЃљрЃЏрЃўрЃЉрЃарЃБрЃюрЃћ.',2,19,307),(91,'рЃфрЃ«рЃарЃўрЃџрЃў',255,10,255),(92,'рЃАрЃљрЃўрЃбрЃў',255,8,255),(93,'рЃЎрЃљрЃџрЃЎрЃБрЃџрЃљрЃбрЃЮрЃарЃў',255,19,255),(94,'wordis fails ver vagdeb\n',271,2,271),(95,'рЃЌрЃљрЃЏрЃљрЃа, рЃЏрЃЌрЃљрЃЋрЃљрЃа рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ html рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃўрЃА рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃљрЃљ рЃАрЃљрЃГрЃўрЃарЃЮ. \nрЃљрЃАрЃћрЃЋрЃћ, рЃюрЃљрЃЋрЃўрЃњрЃљрЃфрЃўрЃўрЃА рЃџрЃўрЃюрЃЎрЃћрЃЉрЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА рЃЕрЃљрЃАрЃЏрЃБрЃџрЃў ul рЃџрЃўрЃАрЃбрЃерЃў.\n\nhttps://students.novatori.ge/рЃЌрЃљрЃЏрЃљрЃа_рЃюрЃљрЃГрЃДрЃћрЃЉрЃўрЃљ/8/pages/courses/react/react.html рЃљрЃЏ рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ \n\n<Link rel=\"icon\" href=\"../../../images/icon.png\" /> рЃбрЃћрЃњрЃў рЃњрЃљрЃЦрЃЋрЃА рЃЊрЃўрЃЊрЃў рЃљрЃАрЃЮрЃЌрЃў рЃЊрЃљрЃгрЃДрЃћрЃЉрЃБрЃџрЃў, рЃърЃљрЃбрЃљрЃарЃљ рЃљрЃАрЃЮрЃћрЃЉрЃўрЃЌ рЃгрЃћрЃарЃћ рЃарЃљ.\n\nрЃАрЃ«рЃЋрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ, рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ',167,8,165),(96,'рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў, рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ рЃЌрЃљрЃЏрЃљрЃа.\n\nlang atributi ar gamogrches xolme ra',167,10,165),(97,'рЃЉрЃЮрЃЎрЃљ, рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃарЃљрЃф рЃЏрЃўрЃюрЃЊрЃљ рЃњрЃўрЃЌрЃ«рЃарЃљ <html>-рЃерЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў рЃљрЃа рЃњрЃљрЃЏрЃЮрЃбрЃЮрЃЋрЃЮ рЃ«рЃЮрЃџрЃЏрЃћ рЃарЃљ. рЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ. рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃДрЃЮрЃЕрЃљрЃд! рЃАрЃ«рЃЋрЃљ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃћрЃЉрЃўрЃф рЃљрЃбрЃЋрЃўрЃарЃЌрЃћ рЃЉрЃљрЃарЃћрЃЏ, рЃЏрЃћрЃЮрЃЌрЃ«рЃћ рЃЊрЃљ рЃЏрЃћрЃћрЃЦрЃЋрЃАрЃћ',167,19,252),(98,'рЃЉрЃЮрЃЎрЃљ, рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃарЃљрЃф рЃЏрЃўрЃюрЃЊрЃљ рЃњрЃўрЃЌрЃ«рЃарЃљ <html>-рЃерЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў рЃљрЃа рЃњрЃљрЃЏрЃЮрЃбрЃЮрЃЋрЃЮ рЃ«рЃЮрЃџрЃЏрЃћ рЃарЃљ. рЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ. рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃДрЃЮрЃЕрЃљрЃд! рЃАрЃ«рЃЋрЃљ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃћрЃЉрЃўрЃф рЃљрЃбрЃЋрЃўрЃарЃЌрЃћ рЃЉрЃљрЃарЃћрЃЏ, рЃЏрЃћрЃЮрЃЌрЃ«рЃћ рЃЊрЃљ рЃЏрЃћрЃћрЃЦрЃЋрЃАрЃћ',167,19,252),(99,'рЃюрЃљрЃЌрЃўрЃљ, рЃФрЃљрЃџрЃўрЃљрЃю рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃЎрЃљрЃарЃњрЃў рЃњрЃЮрЃњрЃЮ рЃ«рЃљрЃа. рЃбрЃћрЃЦрЃАрЃбрЃћрЃЉрЃўрЃф рЃФрЃљрЃљрЃю рЃАрЃљрЃДрЃЋрЃљрЃарЃћрЃџрЃўрЃљ. \nрЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃЊрЃћрЃбрЃљрЃџрЃўрЃљ рЃарЃљрЃф рЃБрЃюрЃЊрЃљ рЃњрЃўрЃЌрЃ«рЃарЃљ:\n1. рЃЊрЃљрЃБрЃюрЃЮрЃЏрЃарЃљрЃЋрЃў рЃАрЃўрЃћрЃЉрЃў рЃњрЃљрЃЦрЃЋрЃА рЃДрЃЮрЃЋрЃћрЃџ рЃ»рЃћрЃарЃќрЃћ рЃљрЃ«рЃџрЃўрЃЊрЃљрЃю рЃЊрЃљрЃгрЃДрЃћрЃЉрЃБрЃџрЃў рЃЊрЃљ рЃўрЃЊрЃћрЃљрЃерЃў рЃерЃћрЃњрЃћрЃФрЃџрЃЮ рЃћрЃарЃЌрЃў рЃЊрЃўрЃЊрЃў рЃАрЃўрЃљ рЃњрЃљрЃњрЃћрЃЎрЃћрЃЌрЃћрЃЉрЃўрЃюрЃљ рЃЏрЃЌрЃљрЃЋрЃљрЃа рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ рЃЊрЃљ рЃўрЃЦ рЃЕрЃљрЃњрЃћрЃАрЃЋрЃљ рЃДрЃЋрЃћрЃџрЃљ рЃАрЃљрЃЌрЃБрЃарЃў. \n2. рЃАрЃљрЃЌрЃљрЃБрЃарЃћрЃЉрЃўрЃА рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃДрЃЋрЃћрЃџрЃњрЃљрЃю рЃЎрЃљрЃарЃњрЃљрЃЊ рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃБрЃџрЃў, рЃ»рЃћрЃа h1-рЃА рЃарЃЮрЃЏ рЃўрЃДрЃћрЃюрЃћрЃЉ, рЃЏрЃћрЃарЃћ h2рЃА рЃЊрЃљ рЃљрЃАрЃћ рЃерЃЏрЃЊрЃћрЃњ. рЃЎрЃљрЃарЃњрЃўрЃљ, рЃћрЃАрЃћ рЃњрЃљрЃљрЃњрЃарЃФрЃћрЃџрЃћ.\n3. рЃцрЃЮрЃџрЃЊрЃћрЃарЃћрЃЉрЃўрЃА рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃЎрЃљрЃарЃњрЃљрЃЊ рЃљрЃарЃўрЃА рЃЊрЃљрЃфрЃБрЃџрЃў.\n\nрЃЏрЃЮрЃЎрЃџрЃћрЃЊ, рЃДрЃЮрЃЕрЃљрЃд',167,8,255),(100,'рЃюрЃљрЃЌрЃўрЃљ, рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃЎрЃљрЃарЃњрЃўрЃљ, рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃАрЃгрЃЮрЃарЃљрЃЊ рЃљрЃарЃўрЃА рЃерЃћрЃАрЃарЃБрЃџрЃћрЃЉрЃБрЃџрЃў, рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃарЃљрЃЏ рЃарЃљрЃф рЃњрЃљрЃЏрЃЮрЃњрЃћрЃърЃљрЃарЃљ, \n<thead> рЃбрЃћрЃњрЃў <table>-рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃБрЃюрЃЊрЃљ рЃњрЃљрЃњрЃћрЃ«рЃюрЃАрЃљ.\nрЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў  рЃАрЃгрЃЮрЃарЃўрЃљ.',167,10,255),(101,'<html>-рЃерЃў lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў рЃЊрЃљрЃгрЃћрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃарЃљ, рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃЕрЃЋрЃћрЃЋрЃљрЃерЃў рЃњрЃљрЃњрЃўрЃ»рЃЊрЃћрЃА.\n\nрЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў, рЃЎрЃљрЃарЃњрЃў рЃњрЃЮрЃњрЃЮ рЃ«рЃљрЃа ',167,19,255),(102,'рЃўрЃЏрЃўрЃбрЃЮрЃЏ рЃарЃЮрЃЏ рЃерЃћрЃќрЃдрЃБрЃЊрЃБрЃџрЃўрЃљ рЃцрЃљрЃўрЃџрЃћрЃЉрЃўрЃА рЃцрЃЮрЃарЃЏрЃљрЃбрЃўрЃА рЃљрЃбрЃЋрЃўрЃарЃЌрЃЋрЃљ, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃћрЃ«рЃџрЃљ рЃЕрЃљрЃЋрЃљрЃАрЃгрЃЮрЃарЃћрЃЌ рЃЊрЃљ рЃерЃћрЃФрЃџрЃћрЃЉ рЃБрЃЎрЃЋрЃћ',167,2,271),(103,'рЃЌрЃљрЃЌрЃўрЃљ, \nрЃарЃљрЃдрЃљрЃфрЃљрЃа рЃљрЃўрЃбрЃЋрЃўрЃарЃЌрЃљ? рЃњрЃЋрЃћрЃарЃЊрЃћрЃЉрЃќрЃћ рЃЋрЃћрЃа рЃњрЃљрЃЊрЃљрЃЋрЃЊрЃўрЃЋрЃљрЃа, рЃЏрЃљрЃњрЃљрЃџрЃўрЃЌрЃљрЃЊ about us-рЃерЃў. рЃљрЃю рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃљрЃўрЃарЃўрЃљ рЃАрЃљрЃюрЃљрЃЏ рЃљрЃбрЃЋрЃўрЃарЃЌрЃљрЃЋрЃЊрЃў. рЃљрЃарЃф рЃцрЃЮрЃбрЃЮ рЃўрЃбрЃЋрЃўрЃарЃЌрЃћрЃЉрЃљ рЃЏрЃЌрЃљрЃЋрЃљрЃа рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ. \nрЃљрЃАрЃћрЃЋрЃћ рЃЋрЃюрЃљрЃ«рЃћ рЃћрЃАрЃћ рЃњрЃћрЃгрЃћрЃарЃљ: <Head>\n<Title>. рЃћрЃА рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљрЃЊ рЃўрЃЌрЃЋрЃџрЃћрЃЉрЃљ, html-рЃерЃў рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃА рЃбрЃћрЃњрЃћрЃЉрЃў рЃърЃљрЃбрЃљрЃарЃљ рЃљрЃАрЃЮрЃћрЃЉрЃўрЃЌ рЃўрЃгрЃћрЃарЃћрЃЉрЃљ рЃЊрЃљ рЃерЃћрЃюрЃф рЃЏрЃљрЃАрЃћ рЃгрЃћрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃарЃљ.\n\nрЃЎрЃБрЃарЃАрЃћрЃЉрЃўрЃА рЃцрЃЮрЃџрЃЊрЃћрЃарЃерЃў <ul> рЃерЃў рЃърЃўрЃарЃЊрЃљрЃърЃўрЃа рЃЕрЃљрЃАрЃЏрЃБрЃџрЃў рЃњрЃљрЃЦрЃЋрЃА <img> element-рЃў рЃарЃљрЃф рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃўрЃљ, <ul> рЃерЃў рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃћрЃџрЃўрЃљ рЃарЃЮрЃЏ рЃърЃўрЃарЃЊрЃљрЃърЃўрЃа <li> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў рЃўрЃДрЃЮрЃА рЃерЃЋрЃўрЃџрЃЮрЃЉрЃўрЃџрЃў рЃЊрЃљ рЃерЃћрЃЏрЃЊрЃћрЃњ рЃерЃћрЃњрЃўрЃФрЃџрЃўрЃљ <img> рЃЕрЃљрЃАрЃЋрЃљ рЃерЃўрЃњрЃюрЃўрЃЌ. \n\nрЃћрЃА рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃЏрЃњрЃЮрЃюрЃў рЃерЃћрЃњрЃўрЃЏрЃЮрЃгрЃЏрЃћ рЃ«рЃЮрЃЏ?',167,8,307),(104,'рЃЌрЃљрЃЌрЃўрЃљ, рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў. \nрЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў, 113 рЃ«рЃљрЃќрЃќрЃћ    </td>-рЃА рЃарЃљ рЃБрЃюрЃЊрЃљ, рЃарЃљрЃА рЃљрЃЎрЃћрЃЌрЃћрЃЉрЃА? :рЃЊрЃЊ \n\nрЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ <3',167,10,307),(105,'рЃљрЃарЃўрЃА рЃАрЃћрЃа',143,10,143),(106,'рЃљрЃ░рЃљрЃ░рЃљ рЃњрЃљрЃЋрЃўрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉ',143,19,143),(107,'рЃЏрЃљрЃарЃў рЃФрЃљрЃџрЃўрЃљрЃю рЃЎрЃљрЃарЃњрЃўрЃљ! рЃДрЃЮрЃЕрЃљрЃд. \nрЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃЌрЃўрЃЌрЃЮ рЃЌрЃћрЃЏрЃљрЃерЃў рЃЌрЃўрЃЌрЃЮ рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃљ рЃљрЃбрЃЋрЃўрЃарЃЌрЃЮ. \n\nKeep Up The Good Work! <3',167,1,154),(108,'ьаЙь╗А рЃљрЃарЃўрЃА',143,8,143),(109,'рЃљрЃў рЃЕрЃљрЃЋрЃљрЃАрЃгрЃЮрЃарЃћ рЃцрЃЮрЃџрЃЊрЃћрЃарЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃў рЃЊрЃљ рЃЏрЃњрЃЮрЃюрЃў рЃарЃЮрЃЏ рЃњрЃљрЃАрЃгрЃЮрЃарЃЊрЃљ рЃДрЃЋрЃћрЃџрЃњрЃљрЃю ^^ рЃЏрЃљрЃЊрЃЊрЃџрЃЮрЃЮрЃЉрЃљрЃљ. рЃљрЃАрЃћрЃЋрЃћ рЃўрЃюрЃЊрЃћрЃЦрЃАрЃў рЃЊрЃљрЃћрЃЊрЃўрЃбрЃћрЃЉрЃБрЃџрЃў рЃЏрЃљрЃЦрЃЋрЃА рЃљрЃ«рЃљрЃџрЃў рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ рЃЊрЃљ рЃ»рЃћрЃа рЃљрЃа рЃЊрЃљрЃЏрЃўрЃАрЃарЃБрЃџрЃћрЃЉрЃўрЃљ рЃЊрЃљ рЃљрЃа рЃерЃћрЃўрЃЏрЃЕрЃюрЃўрЃЮ :рЃЊ рЃЊрЃдрЃћрЃА рЃџрЃћрЃЦрЃфрЃўрЃљрЃЏрЃЊрЃћ рЃљрЃЋрЃбрЃЋрЃўрЃарЃЌрЃљрЃЋ рЃљрЃ«рЃљрЃџ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљрЃерЃў',148,9,148),(110,'рЃЎрЃў рЃЏрЃўрЃерЃљ. рЃЎрЃў рЃЋрЃгрЃЋрЃљрЃџрЃЮрЃЉрЃЊрЃў рЃ«рЃћрЃџрЃўрЃЌ , рЃАрЃгрЃљрЃЋрЃџрЃљ рЃарЃЮрЃфрЃљ рЃЊрЃљрЃЋрЃўрЃгрЃДрЃћ рЃЊрЃљ рЃБрЃЎрЃЋрЃћ рЃЏрЃўрЃЋрЃћрЃЕрЃЋрЃўрЃћ рЃЏрЃњрЃЮрЃюрЃўрЃљ :рЃЊ рЃљрЃЊрЃарЃћ рЃЋрЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉрЃЊрЃў рЃЕрЃћрЃЏрЃўрЃЌ udemy рЃЊрЃљрЃю рЃЊрЃљ рЃўрЃБрЃЌрЃБрЃЉрЃўрЃЊрЃљрЃю Html рЃЊрЃљ Css  рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ.',149,3,149),(111,'рЃЏрЃЮрЃарЃЕрЃљ рЃЉрЃЮрЃџрЃЮрЃ»рЃћрЃа рЃЊрЃљрЃЋрЃљрЃњрЃћрЃюрЃћрЃарЃўрЃарЃћ рЃћрЃЊрЃўрЃбрЃЮрЃарЃўрЃЌ :D рЃљрЃЏрЃўрЃћрЃарЃўрЃЊрЃљрЃю рЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃљрЃЋрЃгрЃћрЃа. ',149,19,149),(112,'рЃљрЃюрЃљ,            \nрЃцрЃЮрЃџрЃЊрЃћрЃарЃћрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃћрЃЉрЃў рЃќрЃЮрЃњрЃў рЃЏрЃљрЃўрЃюрЃф рЃЊрЃўрЃЊрЃў рЃљрЃАрЃЮрЃћрЃЉрЃўрЃЌрЃљрЃљ, рЃњрЃўрЃарЃЕрЃћрЃЋ рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃЏрЃљрЃАрЃћ рЃЦрЃюрЃљ рЃ«рЃЮрЃџрЃЏрЃћ, рЃћрЃарЃЌрЃў рЃЎрЃЮрЃюрЃфрЃћрЃърЃбрЃў рЃљрЃўрЃдрЃЮ рЃЊрЃљ рЃўрЃЏрЃўрЃЌ рЃўрЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮ, рЃЊрЃљ рЃљрЃарЃљ рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃбрЃўрЃърЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃћрЃЉрЃўрЃЌ.\n\nрЃљрЃАрЃћрЃЋрЃћ, 43 рЃ«рЃљрЃќрЃќрЃћ <asaid> рЃћрЃАрЃћ рЃњрЃўрЃгрЃћрЃарЃўрЃљ, <aside> рЃБрЃюрЃЊрЃљ рЃўрЃДрЃЮрЃА.\n\nрЃърЃџрЃБрЃА рЃцрЃЮрЃарЃЏрЃљрЃА рЃарЃЮрЃЏ рЃњрЃљрЃљрЃЎрЃћрЃЌрЃћрЃЉ, label рЃњрЃљрЃБрЃгрЃћрЃарЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃџрЃљрЃЊ рЃЊрЃљ рЃЏрЃўрЃљрЃЏрЃљрЃњрЃарЃћ рЃарЃљ рЃўрЃюрЃцрЃБрЃЌрЃЌрЃљрЃю. рЃЎрЃљрЃарЃњрЃў рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљрЃљ рЃЊрЃљ рЃЌрЃБ рЃЏрЃљрЃАрЃћ рЃЏрЃўрЃћрЃЕрЃЋрЃћрЃЋрЃў рЃЎрЃљрЃарЃњрЃА рЃўрЃќрЃљрЃЋ. \n\nрЃЏрЃЌрЃџрЃўрЃљрЃюрЃЮрЃЉрЃљрЃерЃў рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ',167,9,148),(113,'<link rel=\"icon\" href=\"../Webiste/images/747.png\" /> рЃћрЃАрЃћ рЃарЃЮрЃЏ рЃ«рЃљрЃа рЃњрЃљрЃЏрЃЮрЃАрЃБрЃџрЃў рЃБрЃЎрЃљрЃю рЃЊрЃљ рЃЏрЃћрЃарЃћ \"Webiste\" рЃцрЃЮрЃџрЃЊрЃћрЃарЃерЃў рЃерЃћрЃАрЃБрЃџрЃў :рЃЊрЃЊ рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃўрЃљ, рЃћрЃ«рЃџрЃљ рЃарЃЮ рЃљрЃбрЃЋрЃўрЃарЃЌрЃћ рЃАрЃ«рЃЋрЃљ рЃАрЃўрЃАрЃбрЃћрЃЏрЃљрЃерЃў Webiste рЃцрЃЮрЃџрЃЊрЃћрЃарЃўрЃА рЃюрЃљрЃфрЃЋрЃџрЃљрЃЊ рЃАрЃ«рЃЋрЃљ рЃцрЃЮрЃџрЃЊрЃћрЃарЃерЃў, рЃЋрЃћрЃдрЃљрЃа рЃърЃЮрЃБрЃџрЃЮрЃЉрЃА рЃцрЃљрЃўрЃџрЃћрЃЉрЃА.\n\nhead-рЃерЃў title рЃљрЃа рЃњрЃљрЃЦ рЃЊрЃљ рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃБрЃџрЃў рЃЊрЃљ рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃћрЃџрЃў рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃљ. \n\nрЃЏрЃЮрЃЎрЃџрЃћрЃЊ рЃюрЃў, рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃњрЃљрЃЦрЃЋрЃА рЃљрЃарЃћрЃБрЃџрЃў рЃЊрЃљ рЃБрЃюрЃЊрЃљ рЃњрЃљрЃЏрЃЮрЃљрЃАрЃгрЃЮрЃарЃЮ, рЃАрЃ«рЃЋрЃљ рЃњрЃЋрЃћрЃарЃЊрЃћрЃЉрЃќрЃћрЃф рЃљрЃдрЃљрЃа рЃњрЃљрЃЊрЃљрЃЊрЃўрЃА рЃўрЃњрЃўрЃЋрЃћ рЃЏрЃўрЃќрЃћрЃќрЃўрЃЌ.',167,8,143),(114,'рЃЏрЃћрЃЮрЃарЃћрЃњрЃљрЃю рЃџрЃћрЃўрЃЉрЃџрЃўрЃА рЃбрЃћрЃЦрЃАрЃбрЃў рЃЊрЃљ рЃцрЃџрЃћрЃўрЃАрЃ░рЃЮрЃџрЃЊрЃћрЃарЃў рЃњрЃљрЃЦ рЃљрЃарЃћрЃБрЃџрЃў :рЃЊ рЃАрЃгрЃЮрЃарЃўрЃљ рЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў',167,19,138),(115,'copy / paste :рЃЊ ',138,19,138),(116,'рЃљрЃ░рЃљрЃ░рЃљрЃ░рЃљ рЃцрЃБрЃюрЃЌрЃБрЃерЃўрЃф рЃарЃћрЃфрЃћрЃърЃбрЃўрЃф рЃЏрЃЮрЃЋрЃўрЃФрЃўрЃћрЃћ. рЃЎрЃљрЃарЃњрЃўрЃљ!\n\nhtml-рЃерЃў рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃерЃћрЃћрЃЕрЃЋрЃўрЃЮ рЃџрЃћрЃюрЃњ рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃўрЃА рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃљрЃА рЃЊрЃљ method=\"\" рЃЌрЃБ рЃЊрЃљрЃгрЃћрЃа рЃфрЃљрЃарЃўрЃћрЃџрЃў рЃљрЃа рЃЊрЃљрЃбрЃЮрЃЋрЃЮ. рЃљрЃю рЃерЃћрЃњрЃўрЃФрЃџрЃўрЃљ рЃАрЃљрЃћрЃарЃЌрЃЮрЃЊ рЃљрЃа рЃЊрЃљрЃгрЃћрЃарЃЮ рЃЏрЃћрЃЌрЃЮрЃЊрЃў.',167,19,154),(117,':рЃЊ :рЃЊ :рЃЊ ',167,19,138),(118,'рЃЌрЃљрЃЋрЃўрЃЊрЃљрЃю рЃЋрЃћрЃа рЃЋрЃбрЃЋрЃўрЃарЃЌрЃљрЃЋ рЃарЃљрЃбрЃЮрЃЏрЃдрЃљрЃф',138,19,138),(119,'google search рЃЊрЃљ рЃћрЃА рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃћрЃарЃЌрЃљрЃЊ рЃарЃЮрЃЏ рЃўрЃДрЃЮрЃА\n',138,19,138),(120,'рЃљрЃў рЃћрЃ«рЃџрЃљ рЃЋрЃљрЃАрЃгрЃЮрЃарЃћрЃЉрЃЊрЃў рЃЏрЃљрЃњрЃљрЃА рЃЊрЃљ рЃЏрЃћрЃбрЃљ рЃЕрЃљрЃарЃАрЃћрЃбрЃА рЃЋрЃљрЃЏрЃљрЃбрЃћрЃЉрЃЊрЃў,рЃЊрЃљрЃЏрЃљрЃАрЃгрЃљрЃарЃў рЃерЃћрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃљ :D',154,19,154),(121,'рЃгрЃўрЃюрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў 2 рЃЌрЃЋрЃћ рЃњрЃЋрЃљрЃцрЃарЃЌрЃ«рЃўрЃџрЃћрЃЉрЃЊрЃљ рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃљрЃќрЃћ form-рЃА action рЃЊрЃљ method-рЃА рЃЌрЃБ рЃљрЃа рЃЊрЃљрЃБрЃгрЃћрЃарЃЌ рЃЕрЃљрЃњрЃГрЃарЃўрЃЌ рЃАрЃБрЃџ рЃарЃЮрЃЏ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃ