https:-рЃА рЃљрЃЎрЃџрЃўрЃљ //',2,20,153),(151,'google.html-рЃерЃў рЃФрЃћрЃЉрЃюрЃўрЃА рЃцрЃБрЃюрЃЦрЃфрЃўрЃљ рЃљрЃа рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА. рЃЏрЃљрЃарЃўрЃљрЃЏ, рЃерЃћрЃљрЃЏрЃЮрЃгрЃЏрЃћ рЃ«рЃЮрЃџрЃЏрЃћ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљрЃА рЃарЃЮрЃЏ рЃЊрЃљрЃгрЃћрЃа. рЃЌрЃБ рЃљрЃа рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА рЃћрЃАрЃћрЃўрЃњрЃў рЃарЃљрЃдрЃљрЃф рЃерЃћрЃњрЃћрЃерЃљрЃџрЃљ.',2,20,153),(152,'рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃћрЃЉрЃА рЃерЃЮрЃарЃўрЃА рЃњрЃљрЃЏрЃЮрЃбрЃЮрЃЋрЃћрЃЉрЃўрЃА рЃЊрЃљрЃАрЃЏрЃљ рЃљрЃарЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃў, рЃАрЃ«рЃЋрЃљ рЃцрЃљрЃўрЃџрЃћрЃЉрЃерЃўрЃф рЃњрЃљрЃЦрЃЋрЃА рЃерЃћрЃерЃџрЃўрЃџрЃў.',2,20,153),(153,'рЃЎрЃљрЃарЃњрЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў, рЃљрЃа рЃЏрЃљрЃЦрЃЋрЃА рЃерЃћрЃюрЃўрЃерЃЋрЃюрЃљ ^^',2,10,154),(154,'рЃњрЃБрЃЊ рЃџрЃљрЃЦ! <3',167,1,154),(155,'рЃЎрЃљрЃарЃњрЃў рЃЉрЃўрЃГрЃў рЃ«рЃљрЃа рЃЉрЃЮрЃЎрЃљ, рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў \n<html> -рЃќрЃћ lang=\"ka\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃўрЃА рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃљрЃА рЃЏрЃўрЃћрЃЕрЃЋрЃўрЃћ рЃарЃљ.',167,10,252),(156,'рЃњрЃБрЃњрЃџрЃќрЃћ рЃњрЃљрЃЏрЃЮрЃАрЃгрЃЮрЃарЃћрЃЉрЃБрЃџрЃўрЃљ рЃџрЃћрЃўрЃЉрЃџрЃћрЃЉрЃўрЃА рЃљрЃЏрЃЉрЃљрЃЋрЃў ',167,19,162),(157,'рЃњрЃўрЃњрЃљ, рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ рЃћрЃарЃЌрЃўрЃА рЃњрЃљрЃарЃЊрЃљ, <head> elementi рЃЊрЃљрЃ«рЃБрЃарЃБрЃџрЃў рЃњрЃљрЃЦрЃЋрЃА body рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ (73 рЃ«рЃљрЃќрЃќрЃћ) рЃАрЃгрЃЮрЃарЃў рЃўрЃЦрЃюрЃћрЃЉрЃЮрЃЊрЃљ рЃЉрЃЮрЃЊрЃўрЃЏрЃЊрЃћ рЃЊрЃљрЃ«рЃБрЃарЃЋрЃљ.',167,10,163),(158,'рЃАрЃгрЃЮрЃарЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў',167,19,165),(159,'рЃЉрЃЮрЃЎрЃљ, рЃЏрЃЌрЃљрЃЋрЃљрЃа рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ рЃцрЃЮрЃбрЃЮрЃћрЃЉрЃў рЃарЃЮрЃЏ рЃњрЃљрЃЦрЃЋрЃА, alt рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃЏрЃЮрЃарЃЕрЃћрЃюрЃўрЃџрЃў. \n\nрЃЎрЃЮрЃюрЃбрЃљрЃЦрЃбрЃќрЃћ:\n        <img src=\"../images/Mentors.png\" with=\"400\" height=\"350\"/>\nрЃљрЃарЃф рЃљрЃЦ рЃљрЃарЃўрЃА рЃљрЃџрЃб, рЃЊрЃљ рЃАрЃўрЃњрЃљрЃюрЃўрЃА рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃерЃў рЃћрЃарЃЌрЃў рЃљрЃАрЃЮ рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃЏрЃЮрЃбрЃЮрЃЋрЃћрЃЉрЃБрЃџрЃў.\nux-ui-рЃА рЃцрЃЮрЃбрЃЮрЃерЃўрЃф.\n\n\nрЃЎрЃБрЃарЃАрЃћрЃЉрЃерЃў <ul> рЃЮрЃарЃ»рЃћрЃа рЃњрЃљрЃЦрЃЋрЃА рЃЊрЃљрЃ«рЃБрЃарЃБрЃџрЃў\n\nрЃарЃћрЃљрЃЦрЃбрЃўрЃА рЃЎрЃБрЃарЃАрЃерЃў рЃћрЃарЃЌрЃњрЃљрЃю рЃњрЃљрЃЦрЃЋрЃА </h3> рЃЊрЃљрЃ«рЃБрЃарЃБрЃџрЃў, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃљрЃа рЃњрЃЦрЃЮрЃюрЃЊрЃљ рЃњрЃљрЃ«рЃАрЃюрЃўрЃџрЃў.\n\nрЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ, рЃЎрЃљрЃарЃњрЃў рЃЉрЃўрЃГрЃў рЃ«рЃљрЃа',167,8,252),(160,'рЃљрЃарЃљрЃцрЃарЃўрЃА <3\n\nрЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃў рЃЊрЃћрЃбрЃљрЃџрЃў: <label> рЃБрЃюрЃЊрЃљ рЃўрЃДрЃЮрЃА рЃЊрЃљ рЃљрЃарЃљ <lable>',167,19,252),(161,'рЃюрЃўрЃЎрЃљ, \n\nindex.html рЃБрЃерЃћрЃфрЃЊрЃЮрЃЏрЃЮрЃљ,\ncourses.html рЃерЃў рЃцрЃЮрЃбрЃЮрЃА рЃџрЃўрЃюрЃЎрЃўрЃљ рЃњрЃљрЃцрЃБрЃГрЃћрЃЉрЃБрЃџрЃў,\n\nрЃќрЃЮрЃњрЃљрЃЊрЃљрЃЊ: рЃАрЃљрЃЌрЃљрЃБрЃарЃћрЃЉрЃўрЃА рЃўрЃћрЃарЃљрЃарЃЦрЃўрЃљ рЃЊрЃљрЃўрЃфрЃљрЃЋрЃў рЃарЃљ, h1 рЃА рЃарЃЮрЃЏ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћрЃЉ рЃърЃўрЃарЃЊрЃљрЃърЃўрЃа h3 рЃќрЃћ рЃњрЃљрЃЊрЃљрЃАрЃЋрЃџрЃљрЃА рЃЏрЃЮрЃћрЃарЃўрЃЊрЃћ рЃЊрЃљ рЃ»рЃћрЃа h2 рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћ.\n\nрЃЊрЃљрЃюрЃљрЃарЃЕрЃћрЃюрЃў рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ, рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ',167,8,258),(162,'рЃюрЃўрЃЎрЃљ, рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃЋрЃћрЃа рЃњрЃўрЃърЃЮрЃЋрЃћ, рЃДрЃЮрЃЕрЃљрЃд!',167,10,258),(163,'рЃюрЃўрЃЎрЃљ, \nрЃАрЃгрЃЮрЃарЃў рЃўрЃЦрЃюрЃћрЃЉрЃЮрЃЊрЃљ <label>, рЃерЃћрЃю рЃњрЃўрЃгрЃћрЃарЃўрЃљ <lable>, рЃарЃљрЃф рЃљрЃарЃљрЃАрЃгрЃЮрЃарЃўрЃљ.\nрЃЊрЃљ рЃќрЃЮрЃњрЃљрЃЊрЃљрЃЊ, рЃџрЃћрЃўрЃЉрЃџрЃА рЃарЃЮрЃфрЃљ рЃЦрЃЏрЃюрЃў, рЃерЃўрЃњрЃюрЃўрЃЌ рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃарЃЮрЃЏ рЃарЃљрЃўрЃЏрЃћ рЃбрЃћрЃЦрЃАрЃбрЃў рЃЕрЃљрЃгрЃћрЃарЃЮ. \n\nрЃАрЃ«рЃЋрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃАрЃгрЃЮрЃарЃўрЃљ',167,19,258),(164,'рЃЊрЃљрЃЌрЃЮ, \nрЃљрЃарЃћрЃБрЃџрЃўрЃљ id-рЃА рЃЏрЃўрЃюрЃўрЃГрЃћрЃЉрЃљ рЃБрЃюрЃЊрЃљ рЃЏрЃЮрЃ«рЃЊрЃћрЃА select-рЃерЃў рЃЊрЃљ input-рЃерЃў, рЃ«рЃЮрЃџрЃЮ рЃџрЃћрЃўрЃЉрЃџрЃў рЃБрЃюрЃЊрЃљ рЃЊрЃљрЃБрЃЎрЃЋрЃерЃўрЃарЃЊрЃћрЃА for=\"\" рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃўрЃЌ. рЃерЃћрЃю рЃърЃўрЃарЃўрЃЦрЃўрЃЌ рЃњрЃљрЃЦрЃЋрЃА',167,19,267),(165,'https://1drv.ms/p/s!AmnBlINAw67xcICYHpqrUUG1614?e=tTAWte',238,22,238),(166,'ezz<3\n',252,19,252),(167,'uih utf-8 gamomrchenia da shevasworee))))))',252,19,252),(168,'рЃЎрЃљрЃџрЃЎрЃБрЃџрЃљрЃфрЃўрЃљрЃА рЃљрЃа рЃљрЃЎрЃћрЃЌрЃћрЃЉрЃА рЃЊрЃљ рЃЋрЃћрЃа рЃЋрЃ«рЃЋрЃЊрЃћрЃЉрЃў рЃарЃљ рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљрЃљ',160,19,160),(169,'рЃЏрЃўрЃерЃљ-рЃќрЃБрЃЎрЃљ рЃарЃљрЃф рЃњрЃљрЃЋрЃўрЃљрЃарЃћрЃЌ html-рЃерЃў рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃњрЃљрЃЏрЃЮрЃЋрЃўрЃДрЃћрЃюрЃћ рЃЌрЃўрЃЌрЃЦрЃЏрЃўрЃА рЃЊрЃљ рЃљрЃЋрЃљрЃгрЃДрЃЋрЃћ рЃћрЃА рЃАрЃљрЃўрЃбрЃў. рЃћрЃбрЃљрЃърЃЮрЃЉрЃарЃўрЃЋрЃљрЃЊ рЃЋрЃљрЃЏрЃљрЃбрЃћрЃЉрЃЊрЃў рЃарЃљрЃАрЃљрЃф рЃњрЃљрЃЋрЃўрЃЋрЃџрЃўрЃЊрЃўрЃЌ рЃЊрЃљ рЃАрЃљрЃЉрЃЮрЃџрЃЮрЃЮрЃЊ рЃћрЃА рЃњрЃљрЃЏрЃЮрЃЋрЃўрЃЊрЃљ :D рЃарЃљрЃдрЃљрЃф рЃцрЃљрЃўрЃџрЃћрЃЉрЃў рЃњрЃљрЃљрЃгрЃўрЃЌрЃџрЃљ рЃљрЃбрЃЋрЃўрЃарЃЌрЃЋрЃўрЃА рЃЊрЃарЃЮрЃА рЃЊрЃљ рЃЌрЃБ рЃљрЃа рЃљрЃўрЃбрЃЋрЃўрЃарЃЌрЃљ рЃърЃўрЃарЃљрЃЊрЃерЃў рЃњрЃљрЃЏрЃЮрЃњрЃўрЃњрЃќрЃљрЃЋрЃюрЃўрЃЌ <3',149,20,149),(170,'рЃљрЃАрЃћрЃЋрЃћ, рЃћрЃА рЃарЃљрЃА рЃюрЃўрЃерЃюрЃљрЃЋрЃА? :D <a href=\"+995....рЃЉрЃЮрЃџрЃЮ рЃЮрЃа рЃфрЃўрЃцрЃарЃА рЃљрЃа рЃЋрЃљрЃАрЃљрЃ«рЃћрЃџрЃћрЃЉрЃЌ\"> tel: рЃарЃЮрЃЏ рЃЏрЃўрЃњрЃћрЃгрЃћрЃарЃљ рЃгрЃўрЃю, рЃЎрЃўрЃЊрЃћ рЃ«рЃЮ :D- vaime  es vixumre washla damviwkebia , au ara es tavidan unda gavaketo ar momwons',143,8,143),(171,'рЃюрЃўрЃюрЃў рЃарЃљрЃдрЃљрЃф рЃцрЃЮрЃбрЃЮ рЃњрЃљрЃЦрЃЋрЃА рЃЕрЃљрЃАрЃЏрЃБрЃџрЃў, рЃарЃљрЃф рЃљрЃбрЃЋрЃўрЃарЃЌрЃБрЃџрЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА, ragaceebi wavshale atvirtvisas miwitlebda da megona vshlidi da mainc aitvrita? jandaba gamovasworeb',143,8,143),(172,'mgoni gavaswore shecdomebi.',160,19,160),(173,'рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ рЃюрЃўрЃЎрЃљ, рЃДрЃЮрЃЕрЃљрЃд!',167,20,111),(174,'рЃџрЃБрЃЎрЃљ,\nрЃърЃўрЃарЃЋрЃћрЃџ рЃарЃўрЃњрЃерЃў рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљ рЃарЃЮрЃЏ рЃќрЃарЃБрЃюрЃљрЃЋ рЃЕрЃЋрЃћрЃюрЃќрЃћ рЃЊрЃљ рЃЎрЃЮрЃЊрЃўрЃА рЃАрЃЦрЃарЃўрЃюрЃерЃЮрЃбрЃў рЃЏрЃЮрЃљрЃДрЃЮрЃџрЃћ. рЃљрЃа рЃљрЃарЃўрЃА рЃАрЃљрЃГрЃўрЃарЃЮ, рЃњрЃЋрЃљрЃЦрЃЋрЃА рЃгрЃЋрЃЊрЃЮрЃЏрЃљ рЃЎрЃЮрЃЊрЃќрЃћ рЃЊрЃљ рЃљрЃдрЃљрЃа рЃерЃћрЃгрЃБрЃ«рЃЊрЃћ.\n\nрЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃў рЃЎрЃљрЃарЃњрЃўрЃљ, рЃњрЃљрЃЏрЃЮрЃАрЃгрЃЮрЃарЃћрЃЉрЃБрЃџрЃўрЃљ рЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃљ рЃЊрЃљ рЃЎрЃљрЃџрЃЎрЃБрЃџрЃљрЃбрЃЮрЃарЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА рЃњрЃљрЃЏрЃљрЃарЃЌрЃБрЃџрЃљрЃЊ. рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃџрЃћрЃўрЃЉрЃџрЃў рЃљрЃа рЃњрЃљрЃЦрЃЋрЃА select рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃќрЃћ. рЃћрЃњ рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃљрЃа рЃљрЃарЃўрЃА, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃЎрЃљрЃарЃњрЃў рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљрЃљ рЃарЃЮрЃЏ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃЮ.\n\nрЃЏрЃЮрЃЎрЃџрЃћрЃЊ рЃДрЃЮрЃЕрЃљрЃд',167,19,112),(175,'рЃџрЃљрЃќрЃљрЃарЃћ, рЃЎрЃЮрЃЊрЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА, рЃЎрЃљрЃарЃњрЃўрЃљ.\nрЃЮрЃдрЃЮрЃюрЃЊ :рЃЊ \n\n1. lang рЃљрЃбрЃарЃўрЃЉрЃБрЃбрЃў рЃБрЃюрЃЊрЃљ рЃњрЃљрЃБрЃгрЃћрЃарЃЮ html рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃА рЃЊрЃљ рЃљрЃарЃљ head-рЃА.\n2. рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃДрЃЋрЃћрЃџрЃљ рЃўрЃюрЃцрЃБрЃЌрЃА рЃџрЃћрЃўрЃЉрЃџрЃў рЃњрЃљрЃБрЃгрЃћрЃарЃЮ рЃ«рЃЮрЃџрЃЏрЃћ, рЃљрЃарЃљрЃљ рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃћрЃ«рЃџрЃљ рЃЏрЃљрЃњрЃарЃљрЃЏ рЃфрЃБрЃЊрЃў рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљрЃљ, рЃЊрЃљ рЃарЃЮ рЃЏрЃўрЃћрЃЕрЃЋрЃўрЃЮ рЃћрЃАрЃћ рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљрЃА рЃЎрЃљрЃарЃњрЃў рЃўрЃЦрЃюрЃћрЃЉрЃљ.\n\nрЃАрЃ«рЃЋрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃЎрЃљрЃарЃњрЃўрЃљ',167,19,126),(176,'рЃњрЃўрЃЮрЃарЃњрЃў, \nрЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃцрЃЮрЃарЃЏрЃљ рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА.\n\nрЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃЊрЃћрЃбрЃљрЃџрЃў, рЃарЃЮрЃфрЃљ рЃўрЃюрЃцрЃБрЃЌ рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃА рЃЦрЃЏрЃюрЃў, рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃДрЃЮрЃЋрЃћрЃџрЃЌрЃЋрЃўрЃА рЃњрЃљрЃБрЃгрЃћрЃарЃЮ рЃџрЃћрЃўрЃЉрЃџрЃў (label), рЃАрЃљрЃГрЃўрЃарЃЮрЃљ рЃЊрЃљ рЃЎрЃљрЃарЃњрЃў рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљрЃљ рЃарЃЮрЃЏ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃЮ. ',167,19,139),(177,'рЃ»рЃћрЃа рЃЎрЃўрЃЊрЃћрЃЋ рЃњрЃљрЃАрЃљрЃАрЃгрЃЮрЃарЃћрЃЉрЃћрЃџрЃўрЃљ рЃЕрЃћрЃЏрЃЮ рЃЊрЃљрЃЮ :рЃЊрЃЊ',167,8,143),(178,'рЃарЃљрЃбрЃў, рЃћрЃцрЃџрЃерЃў рЃарЃЮ рЃЋрЃўрЃДрЃЮ рЃАрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃерЃў рЃљрЃњрЃўрЃДрЃЋрЃљрЃюрЃЊрЃў :рЃЊрЃЊрЃЊ\n\nрЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃЏрЃЮрЃЏрЃгрЃЮрЃюрЃА рЃарЃЮрЃЏ рЃЏрЃЮрЃњрЃЋрЃДрЃЋрЃћрЃЉрЃў рЃЊрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃА рЃљрЃЎрЃћрЃЌрЃћрЃЉ рЃарЃљрЃАрЃљрЃф рЃњрЃљрЃЋрЃЊрЃўрЃЋрЃљрЃарЃЌ. рЃљрЃАрЃћ рЃњрЃљрЃюрЃљрЃњрЃарЃФрЃћ',167,20,149),(179,'рЃљрЃЕрЃў рЃБрЃерЃћрЃфрЃЊрЃЮрЃЏрЃЮ рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ, рЃфрЃ«рЃарЃўрЃџрЃў рЃЎрЃљрЃарЃњрЃљрЃЊ рЃњрЃљрЃЦ рЃерЃћрЃЏрЃЮрЃбрЃљрЃюрЃўрЃџрЃў. рЃџрЃўрЃюрЃЎрЃћрЃЉрЃўрЃљ рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ рЃљрЃарЃћрЃБрЃџрЃў рЃарЃљрЃЊрЃњрЃљрЃю рЃАрЃ«рЃЋрЃљ рЃцрЃљрЃўрЃџрЃћрЃЉрЃўрЃљ рЃа рЃњрЃљрЃЦрЃЋрЃА рЃљрЃбрЃЋрЃўрЃарЃЌрЃБрЃџрЃў рЃЏрЃљрЃњрЃарЃљрЃЏ рЃЏрЃћрЃАрЃЏрЃўрЃА рЃарЃЮ рЃАрЃ«рЃЋрЃљ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃўрЃАрЃљрЃљ рЃћрЃњрЃћрЃюрЃў. рЃЎрЃљрЃарЃњрЃўрЃљ рЃЏрЃЮрЃЎрЃџрЃћрЃЊ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў',167,10,150),(180,'рЃљрЃЕрЃў, рЃЎрЃљрЃарЃњрЃўрЃљ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў. рЃЎрЃЮрЃЊрЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА рЃњрЃљрЃЏрЃљрЃарЃЌрЃБрЃџрЃљрЃЊ. \nрЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃарЃљрЃЏ рЃарЃљрЃф рЃЏрЃўрЃюрЃЊрЃљ рЃњрЃўрЃЌрЃ«рЃарЃљ, рЃарЃЮрЃЊрЃћрЃАрЃљрЃф рЃўрЃюрЃцрЃБрЃЌ рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃА рЃЦрЃЏрЃюрЃў, рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃарЃЮрЃЏ рЃџрЃћрЃўрЃЉрЃџрЃў (label) рЃДрЃЮрЃЋрЃћрЃџрЃЌрЃЋрЃўрЃА рЃњрЃљрЃБрЃгрЃћрЃарЃЮ. рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃљрЃарЃљрЃљ, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃЎрЃљрЃарЃњрЃў рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљрЃљ рЃЊрЃљ рЃерЃћрЃћрЃфрЃљрЃЊрЃћ рЃЊрЃљрЃўрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃЮ. ',167,19,150),(181,'рЃЏрЃљрЃарЃўрЃљрЃЏ, рЃљрЃа рЃЋрЃўрЃфрЃў рЃарЃљ рЃЋрЃЦрЃюрЃљ, рЃДрЃЋрЃћрЃџрЃљ рЃћрЃарЃЌрЃљрЃЊ рЃерЃћрЃЋрЃљрЃАрЃгрЃЮрЃарЃЮ рЃЊрЃљ рЃфрЃљрЃџ рЃфрЃљрЃџрЃЎрЃћ рЃЕрЃљрЃЏрЃЮрЃЋрЃДрЃљрЃарЃЮ рЃЎрЃЮрЃЏрЃћрЃюрЃбрЃљрЃарЃћрЃЉрЃў рЃЌрЃБ рЃњрЃЌрЃ«рЃЮрЃЋрЃЮ рЃарЃЮрЃЏ рЃфрЃљрЃџ рЃфрЃљрЃџрЃЎрЃћ рЃљрЃбрЃЋрЃўрЃарЃЌрЃЮ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў. рЃЏрЃњрЃЮрЃюрЃў рЃЮрЃарЃўрЃЋрЃћрЃАрЃЌрЃЋрЃўрЃА рЃљрЃ»рЃЮрЃЉрЃћрЃЉрЃА рЃарЃЮрЃЏ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃўрЃА рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃљрЃЊ рЃЏрЃўрЃљрЃЏрЃљрЃњрЃарЃЮ рЃцрЃљрЃўрЃџрЃћрЃЉрЃў, рЃерЃћрЃюрЃЌрЃЋрЃўрЃА рЃБрЃЎрЃћрЃЌ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃБрЃџрЃў рЃўрЃЦрЃюрЃћрЃЉрЃљ рЃЊрЃљ рЃЏрЃћрЃф рЃЎрЃЮрЃЏрЃћрЃюрЃбрЃљрЃарЃћрЃЉрЃА рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ рЃЊрЃљрЃњрЃўрЃгрЃћрЃа рЃ