ћ рЃ«рЃЮрЃџрЃЏрЃћ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃўрЃЏ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃА рЃЏрЃўрЃљрЃЏрЃљрЃњрЃарЃЮ, рЃарЃЮрЃЏрЃћрЃџ рЃЌрЃћрЃЏрЃљрЃАрЃљрЃф рЃћрЃ«рЃћрЃЉрЃљ',167,21,118),(196,'рЃърЃљрЃърЃБрЃюрЃљ, рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ.\nрЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃљрЃа рЃљрЃарЃўрЃА, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃЎрЃљрЃарЃњрЃў рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљрЃљ input рЃЊрЃљ select рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃћрЃЉрЃА рЃДрЃЮрЃЋрЃћрЃџрЃЌрЃЋрЃўрЃА рЃњрЃљрЃБрЃгрЃћрЃарЃЮ label рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў. рЃЎрЃљрЃарЃњрЃА рЃўрЃќрЃљрЃЋ рЃљрЃЏрЃљрЃА рЃЕрЃЋрЃћрЃЋрЃљрЃАрЃљрЃЋрЃўрЃЌ рЃЌрЃБ рЃњрЃљрЃўрЃ«рЃЊрЃў. ',167,19,132),(197,'рЃЮрЃЏрЃљрЃа,\n\nрЃЎрЃЮрЃЊрЃў рЃњрЃљрЃЏрЃљрЃарЃЌрЃБрЃџрЃўрЃљ, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃерЃћрЃњрЃћрЃФрЃџрЃЮ div рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃерЃў рЃЏрЃЮрЃњрЃћрЃЦрЃфрЃўрЃљ рЃЊрЃљ рЃЎрЃљрЃарЃњрЃљрЃЊ рЃњрЃљрЃАрЃбрЃўрЃџрЃљрЃЋрЃЊрЃў.\n\nрЃљрЃў рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃўрЃА рЃЋрЃўрЃќрЃБрЃљрЃџрЃА рЃарЃЮрЃЏ рЃЊрЃљрЃљрЃЎрЃЋрЃўрЃарЃЊрЃћ, \n\nрЃарЃљ рЃерЃћрЃЋрЃБрЃЎрЃЋрЃћрЃЌрЃћ:\n1. About the LEGEND рЃбрЃћрЃЦрЃАрЃбрЃў рЃЊрЃљ рЃЏрЃўрЃА рЃЦрЃЋрЃћрЃЏрЃЮрЃЌ рЃљрЃарЃАрЃћрЃЉрЃБрЃџрЃў рЃбрЃћрЃЦрЃАрЃбрЃћрЃЉрЃў рЃЕрЃљрЃарЃЕрЃЮрЃерЃўрЃљ, рЃАрЃ«рЃЋрЃљ рЃбрЃЮрЃюрЃўрЃА рЃЏрЃгрЃЋрЃљрЃюрЃћрЃерЃў, рЃюрЃБ рЃЕрЃарЃЊрЃўрЃџрЃћрЃЉрЃўрЃф рЃАрЃљрЃГрЃўрЃарЃЮ рЃўрЃДрЃЮ рЃЏрЃљрЃњрЃарЃљрЃЏ рЃЏрЃћрЃАрЃЏрЃўрЃА рЃљрЃа рЃњрЃљрЃњрЃЋрЃўрЃЋрЃџрЃўрЃљ box-shadow.\n2. unordered list-рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃА рЃгрЃћрЃарЃбрЃўрЃџрЃћрЃЉрЃў рЃўрЃЏрЃљрЃЋрЃћ div-рЃерЃў рЃБрЃюрЃЊрЃљ рЃДрЃЮрЃцрЃўрЃџрЃўрЃДрЃЮ рЃЊрЃљ рЃЊрЃўрЃА рЃАрЃўрЃњрЃљрЃюрЃћ рЃЦрЃЮрЃюрЃЮрЃЊрЃљ рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃБрЃџрЃў, рЃўрЃЦрЃЋрЃћ рЃџрЃљрЃЏрЃљрЃќрЃљрЃЊ рЃЕрЃљрЃЏрЃгрЃЎрЃарЃўрЃЋрЃћрЃЉрЃБрЃџрЃўрЃДрЃЮ.\n\nрЃарЃљ рЃЕрЃљрЃЏрЃЮрЃЋрЃўрЃЊрЃљ:\n1. рЃерЃћрЃю рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў body-рЃерЃў рЃњрЃљрЃЦрЃЋрЃА рЃЊрЃљ рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃљрЃЊ рЃЋрЃћрЃа рЃАрЃљрЃќрЃдрЃЋрЃарЃљрЃЋ.\n2. рЃерЃћрЃю рЃАрЃљрЃЊрЃдрЃљрЃф рЃЏрЃљрЃарЃфрЃ«рЃюрЃўрЃЋ рЃњрЃљрЃЦ рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃБрЃџрЃў рЃЊрЃљ рЃбрЃћрЃЦрЃАрЃбрЃўрЃф рЃўрЃЏрЃўрЃбрЃЮ рЃљрЃарЃўрЃА рЃАрЃўрЃЏрЃћрЃбрЃарЃўрЃБрЃџрЃў рЃарЃЮрЃЏ рЃўрЃњрЃўрЃЋрЃћ рЃарЃљрЃЮрЃЊрЃћрЃюрЃЮрЃЉрЃўрЃА рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃў рЃњрЃљрЃЦрЃЋрЃА рЃЕрЃљрЃџрЃљрЃњрЃћрЃЉрЃБрЃџрЃў :)))\n\nрЃЏрЃЮрЃЊрЃў рЃњрЃљрЃЏрЃЮрЃљрЃАрЃгрЃЮрЃарЃћ рЃћрЃњрЃћрЃюрЃў\nрЃЏрЃЌрЃџрЃўрЃљрЃюрЃЮрЃЉрЃљрЃерЃў рЃЎрЃљрЃарЃњрЃўрЃљ',167,21,133),(198,'рЃ░рЃЮ, рЃЦрЃЋрЃћрЃЏрЃЮрЃЌ footer-рЃўрЃф рЃљрЃа рЃњрЃљрЃЦ, рЃарЃљрЃдрЃљрЃф рЃбрЃћрЃЦрЃАрЃбрЃћрЃЉрЃўрЃљ рЃЕрЃљрЃџрЃљрЃњрЃћрЃЉрЃБрЃџрЃў рЃАрЃБрЃарЃљрЃЌрЃерЃў.',167,21,133),(199,'рЃ░рЃЮ рЃЎрЃўрЃЊрЃћ, рЃќрЃћрЃЏрЃЮрЃЊрЃљрЃю: <ul> рЃерЃў рЃърЃўрЃарЃЊрЃљрЃърЃўрЃа <br>-рЃА рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃљ рЃљрЃа рЃерЃћрЃўрЃФрЃџрЃћрЃЉрЃљ',167,21,133),(200,'рЃарЃћрЃЋрЃљрЃќ, \nIron man:\nрЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃАрЃгрЃЮрЃарЃљрЃЊ рЃњрЃљрЃЦрЃЋрЃА рЃњрЃљрЃЎрЃћрЃЌрЃћрЃЉрЃБрЃџрЃў, рЃўрЃА рЃАрЃбрЃўрЃџрЃћрЃЉрЃў рЃарЃљрЃф рЃњрЃљрЃЋрЃўрЃљрЃарЃћрЃЌ рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЦ рЃЊрЃљ рЃЎрЃљрЃарЃњрЃўрЃљ рЃАрЃћрЃЏрЃљрЃюрЃбрЃўрЃЎрЃБрЃарЃў рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў рЃарЃЮрЃњрЃЮрЃарЃўрЃфрЃљрЃљ рЃЏрЃљрЃњрЃљрЃџрЃўрЃЌрЃљрЃЊ header рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћ.\n\nрЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃЊрЃћрЃбрЃљрЃџрЃўрЃљ рЃўрЃАрЃћрЃЋ рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃБрЃџрЃў рЃарЃЮрЃЏрЃџрЃўрЃА рЃњрЃљрЃЏрЃЮрЃАрЃгрЃЮрЃарЃћрЃЉрЃљрЃф рЃЎрЃљрЃарЃњрЃў рЃўрЃЦрЃюрЃћрЃЉрЃЮрЃЊрЃљ:\nunordered list -рЃерЃў paragraph рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃў рЃљрЃа рЃњрЃГрЃўрЃарЃЊрЃћрЃЉрЃљ, рЃърЃўрЃарЃЊрЃљрЃърЃўрЃа рЃбрЃћрЃЦрЃАрЃбрЃў рЃерЃћрЃњрЃўрЃФрЃџрЃўрЃљ рЃЕрЃљрЃгрЃћрЃарЃЮ рЃ«рЃЮрЃџрЃЏрЃћ.\n\nрЃЊрЃљ рЃљрЃАрЃћрЃЋрЃћ рЃАрЃБрЃџ рЃЦрЃЋрЃћрЃЏрЃЮрЃЌ footer class рЃЎрЃў рЃЋрЃюрЃљрЃ«рЃћ рЃЏрЃљрЃњрЃарЃљрЃЏ <footer> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃўрЃф рЃерЃћрЃњрЃћрЃФрЃџрЃЮ рЃњрЃљрЃЏрЃЮрЃњрЃћрЃДрЃћрЃюрЃћрЃЉрЃўрЃюрЃљ рЃЊрЃљ p рЃерЃўрЃњрЃюрЃўрЃЌ рЃЕрЃљрЃњрЃћрЃАрЃЋрЃљ.\n\nрЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃБрЃерЃћрЃфрЃЊрЃЮрЃЏрЃЮрЃљ',167,21,138),(201,'Survey form-рЃерЃў рЃЋрЃћрЃарЃљрЃцрЃћрЃарЃў рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃЋрЃћрЃа рЃЋрЃўрЃърЃЮрЃЋрЃћ. рЃЎрЃљрЃарЃњрЃўрЃљ <3',167,21,138),(202,'рЃЏрЃљрЃЊрЃџрЃЮрЃЉ рЃќрЃБрЃЎрЃљ, рЃњрЃљрЃЋрЃўрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉ рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃА',138,21,138),(203,'<3 <3 ',167,20,149),(204,'рЃърЃЮрЃќрЃўрЃфрЃўрЃћрЃЉрЃА рЃарЃЮрЃЊрЃўрЃА рЃњрЃљрЃЋрЃўрЃЋрЃџрЃўрЃЌ рЃћрЃарЃЌрЃў рЃАрЃБрЃџрЃў рЃЏрЃљрЃЦ рЃарЃЮ absolute рЃљрЃдрЃљрЃа рЃЋрЃгрЃћрЃарЃЮ рЃЊрЃљрЃЋрЃўрЃбрЃљрЃюрЃ»рЃћ рЃќрЃЮрЃЏрЃћрЃЉрЃўрЃА рЃАрЃгрЃЮрЃарЃћрЃЉрЃўрЃЌ :D \nрЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ div рЃА рЃЌрЃБ рЃЋрЃљрЃћрЃарЃЌрЃўрЃљрЃюрЃћрЃЉ рЃЎрЃўрЃЊрЃћ flex рЃЋрЃбрЃћрЃюрЃў рЃ«рЃЮрЃџрЃЏрЃћ рЃЏрЃљрЃарЃљ рЃЋрЃћрЃа рЃЋрЃљрЃџрЃљрЃњрЃћрЃЉ рЃюрЃЮрЃарЃЏрЃљрЃџрЃБрЃарЃљрЃЊ \n',138,21,138),(205,'рЃљрЃарЃљрЃцрЃарЃўрЃА. Flexbox рЃќрЃћ рЃўрЃЦрЃюрЃћрЃЉрЃљ рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃЎрЃљрЃарЃњрЃў рЃЊрЃљ рЃЏрЃљрЃюрЃљрЃЏрЃЊрЃћ display рЃћрЃЉрЃА рЃњрЃљрЃЋрЃўрЃЋрЃџрЃўрЃЌ рЃЏрЃљрЃњрЃўрЃЌрЃљрЃф рЃЎрЃљрЃарЃњрЃўрЃљ',167,21,138),(206,'рЃљрЃарЃљрЃцрЃарЃўрЃА рЃљрЃЕрЃў',167,19,150),(207,'рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃўрЃА рЃЋрЃћрЃџрЃерЃў рЃљрЃЋрЃбрЃўрЃЋрЃЌрЃћ рЃцрЃљрЃўрЃџрЃћрЃЉрЃў, рЃЏрЃљрЃЦрЃАрЃўрЃЏрЃўрЃџрЃўрЃљрЃю рЃерЃЋрЃљрЃарЃфрЃЏрЃўрЃБрЃџрЃћрЃарЃўрЃА рЃЎрЃБрЃарЃАрЃА рЃњрЃљрЃЋрЃЊрЃўрЃЮрЃЊрЃў рЃљрЃЊрЃарЃћ рЃЊрЃљ рЃЉрЃџрЃЮрЃЏрЃљрЃЊ рЃњрЃБрЃњрЃџрЃў рЃЎрЃў рЃЊрЃљрЃЋрЃўрЃ«рЃЏрЃљрЃарЃћ рЃњрЃљрЃюрЃАрЃљрЃЎрЃБрЃЌрЃарЃћрЃЉрЃўрЃЌ рЃЉрЃБрЃарЃњрЃћрЃарЃЏрЃћрЃюрЃўрЃБрЃќрЃћ рЃЏрЃљрЃарЃљ рЃЏрЃњрЃЮрЃюрЃў рЃфрЃБрЃЊрЃў рЃљрЃа рЃњрЃљрЃЏрЃЮрЃЋрЃўрЃЊрЃљ \n',138,21,138),(208,'рЃарЃљрЃЏрЃћ рЃарЃЕрЃћрЃЋрЃљрЃА рЃўрЃЦрЃљрЃф рЃЌрЃБ рЃЏрЃЮрЃЏрЃфрЃћрЃЏрЃЊрЃў рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃћрЃџрЃў рЃЋрЃўрЃЦрЃюрЃћрЃЉрЃў рЃЋрЃћрЃЊрЃћрЃЉрЃў рЃњрЃљрЃЋрЃљрЃАрЃгрЃЮрЃарЃЮ рЃЌрЃБ рЃарЃљрЃЏрЃћрЃљ',138,21,138),(209,'рЃЌрЃљрЃЏрЃљрЃа:\n\nSurvey form - рЃЏрЃљрЃњрЃљрЃарЃў рЃ«рЃљрЃа! рЃЎрЃљрЃарЃњрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃўрЃљ.\n2 рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљ рЃњрЃўрЃърЃЮрЃЋрЃћ:\n1. id рЃћрЃЉрЃА рЃарЃЮрЃЊрЃћрЃАрЃљрЃф рЃАрЃљрЃќрЃдрЃЋрЃарЃљрЃЋ \" рЃЉрЃарЃГрЃДрЃљрЃџрЃћрЃЉрЃерЃў рЃљрЃа рЃАрЃЋрЃљрЃЋ рЃбрЃћрЃЦрЃАрЃбрЃА рЃарЃљрЃф рЃфрЃБрЃЊрЃў рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљрЃљ.\n2. рЃћрЃарЃЌ-рЃћрЃарЃЌрЃў id, id=\"text\" рЃњрЃљрЃЦрЃЋрЃА 2 рЃ»рЃћрЃа рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃБрЃџрЃў рЃћрЃарЃЌрЃАрЃљ рЃЊрЃљ рЃўрЃЏрЃљрЃЋрЃћ рЃњрЃЋрЃћрЃарЃЊрЃќрЃћ, рЃарЃљрЃф рЃерЃћрЃфрЃЊрЃЮрЃЏрЃљрЃљ. рЃљрЃўрЃЊрЃў рЃБрЃюрЃЊрЃљ рЃўрЃДрЃЮрЃА рЃБрЃюрЃўрЃЎрЃљрЃџрЃБрЃарЃў.\n\nIronman: \n<img src=\"../index.html/images/Marvel-avengers-infinity-war-iron-man-sixth-scale-figure-hot-toys-silo-903421.webp\" />\nрЃћрЃА src рЃЋрЃўрЃЌрЃЮрЃЏ рЃљрЃа рЃЏрЃўрЃюрЃљрЃ«рЃљрЃЋрЃА :рЃЊ index.html-рЃерЃў рЃћрЃФрЃћрЃЉ рЃцрЃЮрЃџрЃЊрЃћрЃарЃА рЃЊрЃљ рЃЏрЃћрЃарЃћ рЃцрЃЮрЃбрЃЮрЃА? :? :рЃЊ <3 \n\nрЃцрЃЮрЃбрЃЮ рЃљрЃа рЃљрЃбрЃЋрЃўрЃарЃЌрЃБрЃџрЃљ. рЃЊрЃљ рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃљрЃЊ рЃљрЃа рЃЏрЃўрЃЏрЃљрЃњрЃарЃћрЃЉрЃБрЃџрЃљ.\nрЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ рЃАрЃгрЃЮрЃарЃљрЃЊ рЃљрЃарЃўрЃА рЃерЃћрЃАрЃарЃБрЃџрЃћрЃЉрЃБрЃџрЃў, рЃћрЃарЃЌрЃљрЃЊрЃћрЃарЃЌрЃў рЃЦрЃЋрЃћрЃЏрЃЮрЃЌ рЃЏрЃўрЃюрЃЊрЃЮрЃЊрЃљ footer рЃњрЃљрЃЏрЃЮрЃњрЃћрЃДрЃћрЃюрЃћрЃЉрЃўрЃюрЃљ рЃЊрЃљ рЃўрЃА рЃбрЃћрЃЦрЃАрЃбрЃў рЃЕрЃљрЃњрЃћрЃгрЃћрЃарЃљ, рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃўрЃА рЃцрЃЮрЃбрЃЮрЃА рЃЦрЃЋрЃћрЃЊрЃљ рЃюрЃљрЃгрЃўрЃџрЃерЃў рЃарЃЮрЃЏрЃљрЃљ.\n\nрЃЏрЃЌрЃџрЃўрЃљрЃюрЃЮрЃЉрЃљрЃерЃў рЃЎрЃљрЃарЃњрЃўрЃљ, рЃЏрЃЮрЃЏрЃгрЃЮрЃюрЃА рЃарЃЮрЃњрЃЮрЃарЃф рЃЏрЃБрЃерЃљрЃЮрЃЉ <3',167,21,165),(210,'рЃЏрЃљрЃЦрЃАрЃўрЃЏрЃўрЃџрЃўрЃљрЃюрЃў рЃЏрЃљрЃњрЃљрЃарЃў рЃФрЃЏрЃљрЃљ :)) рЃЏрЃћрЃф рЃЉрЃћрЃЋрЃарЃў рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃљ. рЃњрЃљрЃЊрЃљрЃЋрЃ«рЃћрЃЊрЃљрЃЋ рЃЊрЃљ рЃЊрЃљрЃЋрЃљрЃЎрЃЮрЃЏрЃћрЃюрЃбрЃљрЃарЃћрЃЉ рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃџрЃљрЃЊ ',167,21,138),(211,'рЃўрЃарЃљрЃЎрЃџрЃў рЃЎрЃљрЃарЃњрЃљрЃЊ рЃЋрЃћрЃа рЃЏрЃўрЃЋрЃ«рЃЋрЃЊрЃў рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃА, рЃљрЃџрЃЉрЃљрЃЌ рЃЉрЃџрЃЮрЃњрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЊрЃљрЃгрЃћрЃарЃћ рЃ«рЃЮ? рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃљрЃарЃў рЃЎрЃљрЃарЃњрЃўрЃљ',167,22,238),(212,'рЃЉрЃљрЃбрЃЮрЃюрЃЮ рЃЊрЃљрЃЋрЃўрЃЌ рЃљрЃЏ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљрЃф рЃЏрЃўрЃљрЃбрЃЋрЃўрЃарЃЌрЃћрЃЌ \"рЃЉрЃљрЃарЃћрЃдрЃљрЃЏ\" :рЃЊрЃЊ',167,21,170),(213,'<center> рЃћрЃџрЃћрЃЏрЃћрЃюрЃбрЃА рЃЎрЃўрЃЊрЃћрЃЋ рЃћрЃарЃЌрЃ«рЃћрЃџ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћрЃЉ рЃЊрЃљ рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљрЃА рЃљрЃдрЃљрЃарЃљрЃА